s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"http://wptavern.com/wpweekly-episode-213-aesop-interactive-acquired\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2433:\"<p>In this short and sweet episode of WordPress Weekly, <a href=\"http://marcuscouch.com/\">Marcus Couch</a> and I discuss the news of the week including, WordCamp Europe 2016, a credit card scam hitting freelancers, and Envato Sites. We also unmask the anonymous buyer who purchased Aesop Interactive.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"http://wptavern.com/tickets-on-sale-for-wordcamp-europe-2016\">Tickets on Sale for WordCamp Europe 2016</a><br />\n<a href=\"http://wptavern.com/aesop-interactive-llc-acquired-by-anonymous-buyer\">Aesop Interactive LLC Acquired by Anonymous Buyer</a><br />\n<a href=\"http://wptavern.com/wordpress-freelancer-adam-soucie-on-the-dangers-of-accepting-credit-cards\">WordPress Freelancer Adam Soucie on the Dangers of Accepting Credit Cards</a><br />\n<a href=\"http://inside.envato.com/introducing-envato-sites/\">Introducing Envato Sites</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/pay-payment-pal-multiple-emails-for-woocommerce/\">PayPal Multiple Emails for WooCommerce </a>allows you to set up a second PayPal email address so you can use a different PayPal account to process payments in WooCommerce when a product in a specific product category is added to the customer&#8217;s shopping cart</p>\n<p><a href=\"https://wordpress.org/plugins/wp-video-floater/\">WP Video Floater</a> allows you to insert a video to a page and as the user scrolls down, the video is pushed to the bottom-right.</p>\n<p><a href=\"https://wordpress.org/plugins/customize-submit-button-for-gravity-forms/\">Customize Submit Button for Gravity Forms</a> lets you customize the submit button in Gravity Forms by switching it to a button element and changing its CSS classes</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, November 25th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #213:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 20 Nov 2015 08:06:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"Matt: Cool Uses of WP-API\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=45609\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://ma.tt/2015/11/cool-uses-of-wp-api/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:194:\"<p>What&#8217;s the coolest uses and applications built on top of WordPress APIs that you&#8217;ve seen? I&#8217;m looking for some examples to highlight in the State of the Word next month.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 18 Nov 2015 15:25:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"WPTavern: How to Replace WordPress’ Default Avatars With Wapuu\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=49023\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"http://wptavern.com/how-to-replace-wordpress-default-avatars-with-wapuu\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2429:\"<p>Out of the box, WordPress allows you to configure the default avatar that displays for commenters that don&#8217;t have one. The choices leave a lot to be desired. Thanks to a new plugin created by <a href=\"https://profiles.wordpress.org/leewillis77/\">Lee Willis,</a> called <a href=\"https://wordpress.org/plugins/wapuuvatar/\">Wapuuvatar</a>, you can replace default avatars with images of Wapuu.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/11/WapuuavatarSettings.png\" rel=\"attachment wp-att-49025\"><img class=\"size-full wp-image-49025\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/11/WapuuavatarSettings.png?resize=822%2C456\" alt=\"Settings for Wapuuavatar\" /></a>Settings for Wapuuavatar\n<p>If you&#8217;re not familiar with Wapuu, it&#8217;s the <a href=\"http://wptavern.com/community-translation-and-wapuu-how-japan-is-shaping-wordpress-history\">official, GPL Licensed mascot</a> of the WordPress project. Throughout the year, a number of WordCamps and local communities across the world have created local versions of the character. In fact, the Tavern has its own Wapuu.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/06/wapuu-wptavern.png\" rel=\"attachment wp-att-45028\"><img class=\"size-full wp-image-45028\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/06/wapuu-wptavern.png?resize=800%2C958\" alt=\"WP Tavern Wapuu\" /></a>WP Tavern Wapuu\n<p>The plugin has two settings. You can either replace the default avatar with random Wapuus or replace <strong>all</strong> Gravatars with Wapuu. Wapuuavatar uses a library of images from the <a href=\"https://github.com/jawordpressorg/wapuu\">official Wapuu GitHub repository</a> and art work created by <a href=\"http://marktimemedia.com/\">Michelle Schulp</a>. Here&#8217;s how it looks in action on WP Tavern.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/WapuuavatarInAction.png\" rel=\"attachment wp-att-49027\"><img class=\"size-full wp-image-49027\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/WapuuavatarInAction.png?resize=329%2C348\" alt=\"Wapuuavatar on the Tavern\" /></a>Wapuuavatar on the Tavern\n<p>Wapuuavatar is an easy way to replace boring avatars with works of art. The plugin works without issue on WordPress 4.4 beta 4 and is <a href=\"https://wordpress.org/plugins/wapuuvatar/\">available for free</a> on WordPress.org.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 18 Nov 2015 02:24:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"WPTavern: Why Some Theme Authors Are Waiting Two Months or More for Their First Review\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=49009\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"http://wptavern.com/why-some-theme-authors-are-waiting-two-months-or-more-for-their-first-review\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7043:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/12/time.jpg\" rel=\"attachment wp-att-35409\"><img class=\"size-full wp-image-35409\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/12/time.jpg?resize=1024%2C496\" alt=\"photo credit: Βethan - cc\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/beth19/4721798240/\">Βethan</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-nd/2.0/\">cc</a>\n<p>Within the last few weeks, we&#8217;ve received emails from readers wanting to know why it&#8217;s taking so long for new themes to be reviewed on WordPress.org. Some theme authors are having to <a href=\"https://themes.trac.wordpress.org/query?status=new&status=reopened&keywords=!~buddypress&col=id&col=summary&col=priority&col=status&col=owner&col=type&col=time&col=changetime&report=5&order=priority\">wait two months</a> or more for their first review.</p>\n<p>Ashley Evans submitted <a href=\"https://themes.trac.wordpress.org/ticket/25318\">her theme</a> in June and she&#8217;s yet to complete the review process. Throughout that time period, both Evans and the reviewer experienced delays in responding to each other. A few months into the review, the <a href=\"https://themes.trac.wordpress.org/ticket/25318#comment:21\">reviewer disappeared</a> and Evans was <a href=\"https://themes.trac.wordpress.org/ticket/25318#comment:23\">assigned a new reviewer</a> two days ago.</p>\n<p>Understandably, the experience has discouraged Evan&#8217;s from submitting anymore themes to the directory:</p>\n<blockquote><p>Back in August, I said, &#8216;Screw it&#8217; and released the theme as a free download on my blog. This process has basically made me vow to stick to adding plugins to the repo and stop adding any more themes.</p>\n<p>I&#8217;m not blaming the theme review team since I can only imagine how much stuff they have to wade through. It&#8217;s just sad that the process has discouraged me from ever doing it again.</p></blockquote>\n<p>On October 9th, Tammie Lister <a href=\"https://make.wordpress.org/themes/2015/10/09/forgotten-review-push-sometimes-themes-get-forgotten-in/\">updated the Theme Review queues</a> and identified a number of themes that fell through the cracks. Most of those <a href=\"https://themes.trac.wordpress.org/query?id=26151,26016,26194,25318,26167,25685,25310,25818,25650,26135,26195,25000,23405,23342,24027,24087,24094,24101,24143,24178,24203,26164,26084,24277,25651,24597,24411,25269,25992,25217,24540,25980,25969,25814,25245,25241,25181,25154,25122,25076,25068,24274,24993,25046,24178,24087,24101,24143,24765&col=id&col=summary&col=owner&col=status&col=time&col=reporter&report=30&order=time\">themes were approved</a> or are still in the review process.</p>\n<h2>The System is Broken</h2>\n<p>Members of the WordPress Theme Review team agree that the system is broken. In June, the team <a href=\"https://make.wordpress.org/themes/2015/06/05/suggested-roadmap/\">published its suggested roadmap</a> to improve multiple facets of the review process. One of the items on the list to help cut down the review queue is the <a href=\"https://make.wordpress.org/themes/2015/10/07/automation-here-we-come/\">auto-approval</a> of theme updates. However, the team is still hard at work trying to code and implement changes to improve the system.</p>\n<h2>Help Them Help You</h2>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/08/school.jpg\" rel=\"attachment wp-att-27795\"><img class=\"size-full wp-image-27795\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/08/school.jpg?resize=1025%2C487\" alt=\"photo credit: Rob Shenk via - cc\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/rcsj/2915797223/\">Rob Shenk</a> via &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-nd/2.0/\">cc</a>\n<p>One of the items high on the team&#8217;s to-do list is to put more effort towards education. In order to do that, Justin Tadlock says the team has to free up resources, &#8220;We need to free up our biggest resources, which are the team members themselves. However, we can&#8217;t free up those people when they&#8217;re spending 100% of their time doing reviews.&#8221;</p>\n<p>The most important thing theme authors can do to speed up the review process is to check that your theme meets the <a href=\"https://make.wordpress.org/themes/handbook/review/required/\">Theme Review Requirements</a>. According to Tadlock, &#8220;The majority of themes submitted don&#8217;t follow the guidelines which considerably slows down the process. Themes will often have 20-30 issues or more. If we can get to a point to where the majority of submissions only have a few minor issues, we really wouldn&#8217;t have a queue.&#8221;</p>\n<p>Theme authors who test their themes against <a href=\"https://codex.wordpress.org/Theme_Unit_Test\">Theme Unit Test Data</a> and the <a href=\"https://wordpress.org/plugins/theme-check/\">Theme Check Plugin</a> substantially improve the system for everyone. What the team needs most is help. Tadlock offers three ways contributors can get involved to improve the situation.</p>\n<ol>\n<li><a href=\"https://make.wordpress.org/themes/handbook/get-involved/become-a-reviewer/\">Doing reviews</a>.</li>\n<li>Tackling Meta Trac tickets related to the theme directory.</li>\n<li>Writing tutorials.</li>\n</ol>\n<p>Tadlock isn&#8217;t sure how to get theme authors to raise the quality of their themes before the initial review, &#8220;That&#8217;s the sort of feedback I want to see from fellow theme authors. What do we need to do to help them get their themes ready before submission?&#8221;</p>\n<h2>How to Get Involved</h2>\n<p>The team is always in need of more theme reviewers. Reviewing themes is a great way to learn theme development and what not to do. If you&#8217;re interested in reviewing themes, read the <a href=\"https://make.wordpress.org/themes/handbook/get-involved/become-a-reviewer/\">following document</a> from the Theme Review Handbook. It explains how to set up a testing environment with an example of a <a href=\"https://make.wordpress.org/themes/handbook/review/review-workflow/\">testing workflow</a>.</p>\n<p>The Theme Review Team also has a project meeting every <a href=\"http://www.timeanddate.com/worldclock/fixedtime.html?iso=20151110T1800\"><abbr class=\"date\" title=\"2015-11-10T18:00:00+00:00\">Tuesday, November 10, 2015, 1:00 PM EST</abbr></a> in the <strong>#themereview</strong> channel on <a href=\"https://make.wordpress.org/chat/\">Slack</a>.</p>\n<h2>Exercise Patience</h2>\n<p>Exercising patience is a difficult thing to do if you&#8217;ve already waited eight weeks or more for the first review. However, fixing the system is going to take time. If you want to know about the status of your theme and it has an assigned reviewer, you should ask for a status update within the ticket. If your theme doesn&#8217;t have an assigned reviewer, you can ask about its status in the <a href=\"https://make.wordpress.org/chat/\">Theme Review Team Slack</a> channel with a link to the theme.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 17 Nov 2015 17:20:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:102:\"WPTavern: Imperva’s Web Application Attack Report Shows Spam Is WordPress’ Largest Security Threat\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48995\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:106:\"http://wptavern.com/impervas-web-application-attack-report-shows-spam-is-wordpress-largest-security-threat\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6738:\"<p><a href=\"http://www.imperva.com\">Imperva</a>, an international cyber security company founded in 2002, published its <a href=\"http://www.imperva.com/docs/HII_Web_Application_Attack_Report_Ed6.pdf\">2015 web application attack report</a>. The report includes a thorough analysis of attack data obtained through its WAF or Web Application Firewall.</p>\n<p>In the report, Imperva&#8217;s application defense center group analyzed 297,954 attacks and 22,850,023 alerts on 198 of the applications it protects behind its WAF. The data is from January 1st, 2015 &#8211; June 30th, 2015 and provides a solid overview of the number and types of attacks web applications are experiencing.</p>\n<p>The report covers a lot of ground but for the purpose of this site, I&#8217;m focusing on WordPress.</p>\n<h2>Analysis Methodology</h2>\n<p>Automated tools recorded the web applications’ traffic and malicious events were documented in log files. Imperva&#8217;s application defense center group analyzed the data using special-purpose software and its knowledge base.</p>\n<p>You can find more information that explains how the data was analyzed on page seven of the report.</p>\n<h2>WordPress Is the Most Attacked CMS Application</h2>\n<p>Out of the 198 applications protected, Imperva identified 55 that are CMS-based, 20 WordPress applications, 11 Drupal, and 24 that are based on 11 other CMS frameworks.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/11/ImpervaAttackIncidentCMSAverage.png\" rel=\"attachment wp-att-48998\"><img class=\"size-full wp-image-48998\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/11/ImpervaAttackIncidentCMSAverage.png?resize=875%2C470\" alt=\"Average Number of Incidents per Applications CMS Slice\" /></a>Average Number of Incidents per Applications CMS Slice\n<p>According to the report, CMS applications suffered an average of three times more attacks than non-CMS applications. WordPress applications suffered from 3,497 attacks in the reported period which is 250% more than non-CMS Applications. Note from the above image that spam attacks against WordPress outnumber all other types of attacks.</p>\n<p>Imperva says the attraction to CMS applications, especially WordPress is not new.</p>\n<blockquote><p>CMS frameworks have an open nature,  with open developer communities that generate a never-ending sequence of plug-ins and add-ons, with varying levels of security. This situation has led to corresponding never-ending flow of CMS vulnerabilities, with WordPress as the leading CMS taking the lead also in the amount of published attacks.</p>\n<p>Furthermore, the fact that WordPress and other CMS applications resemble each other facilitates automated scanning attacks that work effectively on all applications of this type with only minimal adjustments.</p></blockquote>\n<p>Varying levels of security in plugins have led to many vulnerabilities making WordPress the leader in the amount of published attacks.</p>\n<h2>Proportions of Attacks</h2>\n<p>Taking spam attacks out of the equation, the most popular attack type against WordPress applications is (RCE) Remote Command Execution with (RFI) Remote File Inclusion taking second place.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/11/ImpervaAttackTypeProportions.png\" rel=\"attachment wp-att-49000\"><img class=\"size-full wp-image-49000\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/11/ImpervaAttackTypeProportions.png?resize=719%2C400\" alt=\"Proportion of Attack Types\" /></a>Proportion of Attack Types\n<ul>\n<li>Remote File Inclusion (RFI) is an attack that allows an attacker to include a remote file, usually through a script, on the web server. This attack can lead to data theft or manipulation, malicious code execution on the web server, or malicious code execution on the application client side such as JavaScript execution, which can lead to other attacks. This vulnerability occurs due to the use of user-supplied input without proper validation.</li>\n</ul>\n<ul>\n<li>Remote Command Execution (RCE) is an attack that allows the attacker to execute operating system commands in a system shell. The attack exploits applications that suffer from insufficient input validation in conjunction with passing this input to a system shell. The attacker’s payload is executed with the same privileges of the vulnerable application and can lead to full compromise of the server.</li>\n</ul>\n<p>Even though the other monitored CMS applications are written in PHP, RFI attacks on WordPress are significantly higher than all other applications. Imperva offers one possible explanation:</p>\n<blockquote><p>Attackers don’t target a specific application, but start with scanning the Internet for vulnerable applications. A Low Hanging Fruit approach that is simple and effective for the detection of potential RFI targets, would be to run a WordPress test and mount an RFI attack in case of success.</p></blockquote>\n<p>The <a href=\"http://www.imperva.com/docs/HII_Web_Application_Attack_Report_Ed6.pdf\">report</a> goes on to show geographic attack trends, PHP vs non-PHP attack incidents, traffic volume, case studies, and more.</p>\n<h2>No Need to Panic</h2>\n<p>Even though it&#8217;s only six months of data, the results don&#8217;t surprise me. WordPress is <a href=\"http://wptavern.com/a-quarter-of-the-top-10-million-sites-ranked-by-alexa-use-wordpress\">used on a quarter of the top 10 million websites</a> ranked by Alexa so of course its going to be the most attacked CMS.</p>\n<p>The data in the report reinforces my belief that every public site online is likely being scanned or attacked multiple times a day. Unless you&#8217;re using a service or plugin that logs these types of attacks, its hard to know how popular of a target a site is.</p>\n<p>If you&#8217;re aware of a plugin or service that provides a user-friendly interface that shows and explains the attacks it&#8217;s protecting against a site, please send me a link in the comments.</p>\n<h2>Basic Security Principles</h2>\n<p>It&#8217;s imperative that you use a <a href=\"https://en.wikipedia.org/wiki/Two-factor_authentication\">strong password</a> and <a href=\"https://en.wikipedia.org/wiki/Two-factor_authentication\">two-factor authentication</a>. Consider using a service like <a href=\"https://getclef.com/\">Clef</a> that allows you to login to WordPress without a password. I also highly encourage you to read the <a href=\"http://wptavern.com/wordpress-publishes-security-white-paper\">WordPress security whitepaper</a> to learn how WordPress protects itself against common attacks mentioned in Imperva&#8217;s report and how to responsibly disclose a WordPress security vulnerability.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 17 Nov 2015 02:11:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"WPTavern: WordPress Freelancer Adam Soucie on the Dangers of Accepting Credit Cards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48990\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"http://wptavern.com/wordpress-freelancer-adam-soucie-on-the-dangers-of-accepting-credit-cards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2202:\"<p>If you&#8217;re running or opening a new WordPress business, you should read <a href=\"http://adamsoucie.com/chargebacks-the-dangers-of-accepting-credit-cards/\">Adam Soucie&#8217;s warning</a> on the dangers of accepting credit cards. Soucie, a WordPress Developer based in Orlando, Florida describes what happened after working with a client that claimed to be hearing disabled.</p>\n<p>Soucie went through the usual process of sending over a contract, bringing in a designer, discussing scope, and sending over an invoice. The client then claimed to be in the hospital and requested help to pay for one of the contractors involved in the project because he didn&#8217;t accept credit cards. According to Soucie, this should have been the red flag:</p>\n<blockquote><p>But I ignored it because I’ve also been a trusting person who is sympathetic to people with disabilities.  Plus I figured I had proof of everything, so I’d be protected.  I was so wrong.</p>\n<p>To make a long story short, the &#8216;client&#8217; was paying with stolen credit cards and the other contractor was in on the scam.  I discovered the scam when they started getting pushy about the contractor receiving his payments.  When leaving to make the final payment, I got a call from the person whose credit card info was stolen.  I reached out to my &#8216;client&#8217; and she had disappeared.</p></blockquote>\n<p>As the merchant, Soucie was liable for the transaction. After not receiving help from the FBI Cyber Crimes division and the credit card companies, QuickBooks, Soucie&#8217;s payment processor, went after him for the total amount of $10,000. He was able to get the amount slightly reduced after working with QuickBooks. What looked like an awesome project quickly turned into a nightmare.</p>\n<p>I highly encourage you to <a href=\"http://adamsoucie.com/chargebacks-the-dangers-of-accepting-credit-cards/\">read his article</a> as it includes tips to protect yourself and why you shouldn&#8217;t be too trusting. What advice do you have for freelancers who accept credit card payments? What signs should freelancers look for to avoid fraudulent scams like this one?</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 16 Nov 2015 18:26:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"WPTavern: Aesop Interactive LLC Acquired by Anonymous Buyer\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48972\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"http://wptavern.com/aesop-interactive-llc-acquired-by-anonymous-buyer\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2890:\"<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/02/aesop.png\" rel=\"attachment wp-att-17210\"><img class=\"aligncenter size-full wp-image-17210\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/02/aesop.png?resize=800%2C259\" alt=\"aesop\" /></a>Earlier this year, Nick Haskins, founder of <a href=\"http://aesopinteractive.com/\">Aesop Interactive LLC</a>, announced he was <a href=\"http://nickhaskins.com/2015/07/on-life-and-family/\">selling the company</a>. Haskins was initially going to list the company on Flippa but after receiving advice from <a href=\"https://syedbalkhi.com/\">Syed Balkhi</a>, used <a href=\"http://feinternational.com/\">FE International</a> to facilitate the sale. FE International is composed of website brokers that do the heavy lifting to help businesses find buyers.</p>\n<p>An anonymous company based on the US East Coast without ties to the WordPress community is the new owner of Aesop Interactive LLC. Although terms of the deal are not public, Haskins confirms that he received close to his asking price of $100K.</p>\n<p>When Haskins put the company up for sale, he specified two conditions the new owner must follow.</p>\n<ol>\n<li>Aesop Story Engine MUST absolutely be maintained and kept free.</li>\n<li>Editus must continue forward with development, in some way shape or form.</li>\n</ol>\n<p>It&#8217;s unclear what the new owner&#8217;s plans are for Aesop Story Engine, Editus, and Story.AM.</p>\n<h2>Advice for Selling Your Company</h2>\n<p>The WordPress ecosystem is filled with thousands of companies from individuals to 50+ person agencies. Haskins offers the following advice for those thinking about selling their business, &#8220;Make sure that the books are buttoned up tight, because every check, every payment, every expense will be scrutinized and will ultimately determine what the appraisal price will be. Run a lean ship as the less overhead you have, the better.&#8221;</p>\n<p>During the appraisal process, Haskins had to account for and explain every check number written during the last few months. Although it was a lot of work on his end, he highly recommends using FE International as they manage the negotiating, contract writing, and appraisal processes.</p>\n<h2>What’s Next for Haskins?</h2>\n<p>Haskins isn&#8217;t giving up WordPress development as he continues to work with the software on a daily basis managing <a href=\"https://cgcookie.com/\">CGCookie</a>. When I asked what&#8217;s next in his WordPress journey, he replied, &#8220;Overall, there will be another project. It&#8217;s just that this chapter of the story is finished. I want to eventually write and publish an eBook on my experiences of starting, running, and selling a business.&#8221;</p>\n<p>Who do you think the buyer is and what do you think will happen to Aesop Story Engine, Editus, and Story.AM?</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 13 Nov 2015 22:31:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"WPTavern: Tickets on Sale for WordCamp Europe 2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48959\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"http://wptavern.com/tickets-on-sale-for-wordcamp-europe-2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2056:\"<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/11/WordCampEuropeFeaturedImage2.png\" rel=\"attachment wp-att-48961\"><img class=\"aligncenter size-full wp-image-48961\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/11/WordCampEuropeFeaturedImage2.png?resize=1025%2C450\" alt=\"WordCamp Europe Featured Image\" /></a>Nearly seven months before the event takes place, tickets for <a href=\"https://europe.wordcamp.org/2016/\">WordCamp Europe 2016</a> in Vienna, Austria on June 24-26 <a href=\"https://europe.wordcamp.org/2016/tickets/\">are on sale. </a> There are two types of tickets available, General admission and Microsponsor.</p>\n<p>General admission tickets are € 40.00 each and cover both days to the event, <span class=\"tix-ticket-excerpt\">access to all sessions, lunch, coffee breaks, warm up events, and the after party. It also includes a WCEU 2016 t-shirt, stickers and other swag. </span></p>\n<p>Microsponsor tickets are € 150.00 and includes everything the general admission ticket offers. The major difference between the two besides cost, is that the microsponsor ticket is a<span class=\"tix-ticket-excerpt\"> great way to support the European WordPress community. Microsponsorships shows appreciation of the event and grants you a special mention on the <a href=\"https://europe.wordcamp.org/2016/wordcamp-europe-2016-call-for-sponsors-wceu/\">sponsorship page</a>.</span></p>\n<p>Before you purchase tickets, it&#8217;s important to note that due to Paypal&#8217;s 60 day refund policy, the event is not issuing refunds. If you buy a ticket and want to give it away as a gift, or sell it to someone, you&#8217;ll need to edit the details using the link in your ticket purchase confirmation email.</p>\n<p>Although the schedule is not yet posted, WordCamp Europe has an <a href=\"http://wptavern.com/wordpress-beyond-boundaries-a-recap-of-wordcamp-europe-2014\">established history</a> of being one of the best WordPress events of the year. Let us know if you plan on attending.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 12 Nov 2015 20:02:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"WPTavern: BuddyPress 2.4.0 “Pietro” Contains Major Improvements to Accessibility\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48951\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"http://wptavern.com/buddypress-2-4-0-pietro-contains-major-improvements-to-accessibility\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3538:\"<p>BuddyPress 2.4.0 &#8220;Pietro&#8221; named after an authentic Italian restaurant in Paris, France is <a href=\"https://buddypress.org/2015/11/buddypress-2-4-0-pietro/\">available for download</a>. This release includes support for cover photos that users can add to their profile or a group.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/11/BuddyPressCoverPhotos.png\" rel=\"attachment wp-att-48952\"><img class=\"size-full wp-image-48952\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/11/BuddyPressCoverPhotos.png?resize=790%2C310\" alt=\"BuddyPress Cover Photo Support\" /></a>BuddyPress Cover Photos\n<p>Cover photos are built on top of the BuddyPress Attachments API meaning they should seamlessly integrate into themes. If you need to fine-tune the output for your site, check out the <a href=\"https://codex.buddypress.org/themes/buddypress-cover-images/\">following Codex article</a>.</p>\n<p>Initially added in BuddyPress 2.2.0, <a href=\"https://codex.buddypress.org/developer/member-types/\">Member Types</a> allows developers to categorize the members of their community in a variety of ways. If you use this feature in your community, you can now specify that profile fields be made available to either one, some, or none of the registered Member Types.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/11/MemberTypeFields.png\" rel=\"attachment wp-att-48953\"><img class=\"size-full wp-image-48953\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/11/MemberTypeFields.png?resize=844%2C464\" alt=\"Member Type Fields\" /></a>Member Type Fields\n<p>Two companion stylesheets are included with 2.4.0 to make sure content looks great on both the TwentySixteen and TwentyThirteen themes.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/11/CompanionStylesheets.png\" rel=\"attachment wp-att-48954\"><img class=\"size-full wp-image-48954\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/11/CompanionStylesheets.png?resize=844%2C464\" alt=\"Companion StyleSheets\" /></a>Companion StyleSheets\n<p>This release also includes major accessibility improvements to front-end templates and the Dashboard screens. According to BuddyPress developers, accessibility is a major focus of the project and there is a concentrated, ongoing effort to make the software more accessible to users of all abilities.</p>\n<p>Thanks to a new <a href=\"https://codex.buddypress.org/themes/theme-compatibility-1-7/template-hierarchy/#single-groups-front-page\">template hierarchy</a>, groups can now have unique header images and layouts. Simply use the new <code>front.php</code> template inside the single groups templates directory.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/UniqueHomepages.png\" rel=\"attachment wp-att-48955\"><img class=\"size-full wp-image-48955\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/UniqueHomepages.png?resize=844%2C464\" alt=\"Unique Homepages for Groups\" /></a>Unique Homepages for Groups\n<p>In addition to all of the improvements listed above, 2.4.0 has over 100 bug fixes. It also contains the <a href=\"http://wptavern.com/buddypress-2-3-5-patches-privilege-escalation-issue\">security patch</a> applied in 2.3.5. BuddyPress is <a href=\"https://wordpress.org/plugins/buddypress/\">available for free</a> from the WordPress plugin directory and if you run into any issues, you&#8217;re encouraged to report them in the <a href=\"https://buddypress.org/support/\">support forums</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 12 Nov 2015 19:25:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"WPTavern: A Field Guide to Major Features in WordPress 4.4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48946\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"http://wptavern.com/a-field-guide-to-major-features-in-wordpress-4-4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1036:\"<p>The <a href=\"https://make.wordpress.org/core/2015/11/11/wordpress-4-4-field-guide/\">WordPress 4.4 field guide</a> is available and covers all of the major features in WordPress 4.4. The guide explains what the features are and more specifically, links to posts that explain how they work.</p>\n<blockquote class=\"wp-embedded-content\"><p><a href=\"https://make.wordpress.org/core/2015/11/11/wordpress-4-4-field-guide/\">WordPress 4.4: Field Guide</a></p></blockquote>\n<p></p>\n<p>While it doesn&#8217;t cover every single change, it gives developers and site maintainers an opportunity to learn and understand the major features before WordPress 4.4&#8217;s release.</p>\n<p>If you haven&#8217;t tested your plugins and themes with WordPress 4.4, now is a great time to do so. In testing WordPress 4.4 betas on WP Tavern, I discovered two broken plugins. I notified the developers and they quickly released an update addressing the issues.</p>\n<p>WordPress 4.4 is scheduled for release in December.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 12 Nov 2015 18:18:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:10;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"WPTavern: WPWeekly Episode 212 – Criticizing Criticism\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48941\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"http://wptavern.com/wpweekly-episode-212-criticizing-criticism\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2845:\"<p>In this episode, <a href=\"http://marcuscouch.com/\">Marcus Couch</a> and I discuss the last two weeks of WordPress news. We go in-depth on what&#8217;s coming in WordPress 4.4 and I share a story of how upgrading WP Tavern to WordPress 4.4 beta 4 generated a white screen of death.</p>\n<p>We cover what&#8217;s new in BuddyPress 2.4 and celebrate the milestone that WordPress is used on 25% of the top 10 million sites ranked by Alexa. Last but not least, we discuss how WordPress may reach 50% and what it means for the web.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"https://wordpress.org/news/2015/11/wordpress-4-4-beta-4/\">WordPress 4.4 Beta 4 Released</a><br />\n<a href=\"http://wptavern.com/wp-remote-is-up-for-sale\">WP Remote Is Up for Sale</a><br />\n<a href=\"http://wptavern.com/pro-plugin-directory-is-seeking-a-new-owner\">Pro Plugin Directory Is Seeking a New Owner</a><br />\n<a href=\"https://buddypress.org/2015/11/buddypress-2-4-0-pietro/\">BuddyPress 2.4.0 – “Pietro”</a><br />\n<a href=\"http://wptavern.com/more-than-250-tickets-still-available-for-wordcamp-us\">More Than 250 Tickets Still Available for WordCamp US</a><br />\n<a href=\"http://wptavern.com/a-quarter-of-the-top-10-million-sites-ranked-by-alexa-use-wordpress\">A Quarter of the Top 10 Million Sites Ranked by Alexa Use WordPress</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/ad-blocking-advisor/\">Ad Blocking Advisor</a> adds a simple and elegant notification bar to your site that only displays to visitors who are using ad blocking software. The purpose of the notification is to ask (or advise) visitors to whitelist your site.</p>\n<p><a href=\"https://wordpress.org/plugins/matchheight/\">MatchHeight</a> adds the MatchHeight jQuery plugin to make the height of all selected elements exactly equal.</p>\n<p><a href=\"https://wordpress.org/plugins/wp-term-images/\">WP Term Images</a> by <a href=\"https://profiles.wordpress.org/johnjamesjacoby/\">John James Jacoby </a>allows users to assign images to any visible category, tag, or taxonomy term using the media library, providing a customized look for taxonomies.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, November 18th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #212:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 12 Nov 2015 17:55:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"WPTavern: WP Remote Is Up for Sale\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48911\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com/wp-remote-is-up-for-sale\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2556:\"<p><a href=\"https://hmn.md/\">Human Made LTD</a> is <a href=\"https://hmn.md/2015/11/06/wp-remote-deserves-a-better-home-so-were-selling-it/\">selling</a> its WordPress remote management service <a href=\"https://wpremote.com\">WP Remote</a>. Launched in 2009 as a plugin called Site Monitor, the service has evolved over time to allow users to upgrade themes, plugins, and WordPress remotely. The service allows an unlimited amount of sites to be tracked for free.</p>\n<p>Human Made is not able to devote the time and resources necessary to maintain the service, even as it continues to do well. According to Tom Willmot, Co-founder and CEO of Human Made, the team backed out of the <a href=\"https://wpremote.com/2013/10/04/the-new-wpremote/\">premium version</a> of the service due to a lack of resources:</p>\n<blockquote><p>We had <a href=\"https://wpremote.com/blog/\">ambitious plans for a version 2</a>, we <a href=\"https://wpremote.com/2013/10/04/the-new-wpremote/\">introduced a premium version</a> that we backed out of because we didn’t have the resources to run and grow it, and we’ve got lots of great ideas both from its users and ourselves that we haven’t been able to act on. We’re too busy with other things, including Happytables, our client work, events, and more.</p></blockquote>\n<p>WP Remote has over 18K users with more than 96K sites monitored. Here are some other notable statistics:</p>\n<ul>\n<li>1,850 people logged in during the past 30 days.</li>\n<li>1,200 of those have more than five sites added to their account and 110 of them have more than 50 sites monitored.</li>\n<li>In the past 30 days WP Remote was used to perform over 20,000 plugin updates.</li>\n<li>Each week between 50 and 100 new users sign up and over half of them go on to add a site.</li>\n</ul>\n<p>Although WP Remote converted 60 free users to its premium service, the company eliminated it due to the lack of internal resources to support, develop, and market it. WP Remote also has key relationships with web hosting companies such as, Pressable, BlueHost, and SiteGround.</p>\n<p>Before inquiring about purchasing the service, I recommend that you <a href=\"https://wpremote.com/2013/08/08/the-story-of-wp-remote/\">read the history</a> on how it was created. If you&#8217;re interested in acquiring WP Remote or have questions, contact Tom at  <a href=\"mailto:tom@hmn.md\">tom@hmn.md</a>. The company plans to decide who the buyer is by the end of February 2016 and is in early discussions with a few interested parties.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 12 Nov 2015 00:52:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"WPTavern: Pro Plugin Directory Is Seeking a New Owner\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48913\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"http://wptavern.com/pro-plugin-directory-is-seeking-a-new-owner\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3263:\"<p>Steven Gliebe, creator of<a href=\"https://proplugindirectory.com/\"> Pro Plugin Directory,</a> is looking for <a href=\"https://proplugindirectory.com/for-sale/\">a new owner</a>. The site launched earlier this year and has more than 170 plugins listed in the directory. Gliebe doesn&#8217;t have the time to manage the project anymore and is looking to give it to someone who is capable of maximizing the site&#8217;s potential.</p>\n<p>Since May of this year, commercial plugin developers have slowly added their products to the directory. Gliebe explains his original strategy for monetizing the site, &#8220;Build the directory up (get authors to list their plugins) in order to attract traffic (plugin buyers) then monetize it with display ads, affiliate links and/or sponsorships (not yet started).&#8221;</p>\n<p>Gliebe spends 1-2 hours per week managing the directory which includes, moderating submissions, moderating comments, moderating reviews, answering emails, and responding to tweets. He suggests that the new owner will need to spend more time marketing in order for the project to keep growing.</p>\n<p>One of the most interesting parts of the sale offer is where Gliebe explains what powers the site:</p>\n<blockquote><p>The site is powered by Easy Digital Downloads, the <a href=\"https://easydigitaldownloads.com/downloads/frontend-submissions/\" target=\"_blank\">Frontend Submissions</a> extension, the <a href=\"https://easydigitaldownloads.com/downloads/product-reviews/\" target=\"_blank\">Product Reviews</a> extension and Array’s <a href=\"https://arraythemes.com/themes/checkout-wordpress-theme/\" target=\"_blank\">Checkout</a> theme (using a child theme for customizations like showing categories on the homepage).</p></blockquote>\n<p>Looking at the analytics, the site is experiencing low traffic numbers compared to when the site was launched. However, organic search traffic is steadily rising thanks to the content published on the <a href=\"https://proplugindirectory.com/blog/\">site&#8217;s blog</a>.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/ProPluginTrafficStats.png\" rel=\"attachment wp-att-48925\"><img class=\"size-full wp-image-48925\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/ProPluginTrafficStats.png?resize=814%2C1216\" alt=\"Pro Plugin Directory Traffic\" /></a>Pro Plugin Directory Traffic\n<p>Outside of Codecanyon, Pro Plugin Directory is one of the only other directories exclusively catered to commercial plugins. Here&#8217;s what Gliebe will give the buyer after purchasing the site:</p>\n<blockquote><p>The buyer will receive the domain, website files, database dump, mailing lists and Twitter account. Easy Digital Downloads add-on licenses and Checkout theme licenses will be transferred. You will need to purchase a new SSL certificate. I am looking for a capable buyer but if you require migration assistance or technical support after the sale, I will offer my services at $200/hour (five hours max).</p></blockquote>\n<p>Escrow will be used to facilitate the sale between both parties. If you&#8217;re interested in taking over the site or have questions, <a href=\"https://proplugindirectory.com/contact/\">contact Steven Gliebe.</a></p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 11 Nov 2015 22:51:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"Post Status: How to design a commercial WordPress theme — Draft podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=14888\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://poststatus.com/how-to-design-a-commercial-wordpress-theme-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2465:\"<p>Welcome to the Post Status Draft podcast, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>, <a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>, and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher.</p>\n<p>Joe is away this week, so Brian goes solo. Brian highlights WordCamp US and A Day of REST and describes why you should attend these events. He also tells the story of his first ever WordCamp San Francisco (the precursor to WCUS). Then, he interviews Mike McAlister, of Array Themes, and they talk about the process of building a commercial WordPress theme from the ground up.</p>\n<p>The interview with Mike starts around 14 minutes in.</p>\n<!--[if lt IE 9]><script>document.createElement(\'audio\');</script><![endif]-->\n<a href=\"https://audio.simplecast.fm/19978.mp3\">https://audio.simplecast.fm/19978.mp3</a>\n<p><a href=\"http://audio.simplecast.fm/19978.mp3\">Direct Download</a><br />\n<strong>Topics &amp; Links</strong></p>\n<h3>Event Links</h3>\n<ul>\n<li><a href=\"https://2015.us.wordcamp.org/\">WordCamp US</a></li>\n<li><a href=\"https://feelingrestful.com/\">A Day of REST</a></li>\n<li><a href=\"https://poststatus.com/a-day-of-rest-a-conference-devoted-to-the-wordpress-rest-api/\">Brian&#8217;s post on A Day of REST</a></li>\n<li><a href=\"https://sf.wordcamp.org/2014/my-first-wordcamp-san-francisco/\">Brian&#8217;s first WordCamp SF</a></li>\n<li><a href=\"https://poststatus.com/product/wordcamp-us-party/\">Post Status and Pagely party</a></li>\n<li><a href=\"https://poststatus.com/club/\">Join the Post Status Club</a></li>\n<li><a href=\"https://poststatus.com/the-wordpress-rest-api-draft-podcast/\">Podcast on the REST API</a></li>\n</ul>\n<h3>Interview with Mike</h3>\n<ul>\n<li><a href=\"https://arraythemes.com/\">Array Themes</a></li>\n<li>Previous<a href=\"https://poststatus.com/array-wordpress-theme-business-mike-mcalister/\"> interview with Mike</a></li>\n<li><a href=\"http://typecast.com/\">Typecast</a> for testing typefaces</li>\n<li><a href=\"https://www.typewolf.com/\">Typewolf</a> for type inspiration and resources</li>\n<li><a href=\"https://poststatus.com/playing-with-type/\">Playing with type</a></li>\n<li>Brian&#8217;s 2010 article on the <a href=\"http://wpcandy.com/thinks/is-there-a-profit-ceiling-to-the-premium-theme-market/#.VkOQb66rTeQ\">profit ceiling in the theme market</a></li>\n</ul>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 11 Nov 2015 19:13:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Katie Richards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"WPTavern: BuddyPress 2.3.5 Patches Privilege Escalation Issue\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48918\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"http://wptavern.com/buddypress-2-3-5-patches-privilege-escalation-issue\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:994:\"<p>BuddyPress 2.3.5 <a href=\"https://buddypress.org/2015/11/buddypress-2-3-5/\">is available</a> and patches a security vulnerability that may allow privilege escalation for logged-in users. BuddyPress 2.3.4 and previous versions are affected however, versions 2.0.4, 2.1.2, and 2.2.4 include the patch.</p>\n<p>According to the BuddyPress development team, there is no evidence that the bug has been exploited in the wild. If your WordPress site supports automatic updates to point releases, it will likely be updated by the time you read this post.</p>\n<p><a href=\"https://profiles.wordpress.org/slaFFik\">Slava Abakumov</a> discovered the vulnerability and <a href=\"https://make.wordpress.org/core/handbook/reporting-security-vulnerabilities/\">responsibly disclosed</a> it to the development team. If you run into any issues with the update, you&#8217;re encouraged to post on the BuddyPress <a href=\"https://buddypress.org/support/\">support forums</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 11 Nov 2015 07:42:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"Matt: Arthur C. Clarke on Distributed Work\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=45546\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"http://ma.tt/2015/11/arthur-c-clarke-on-distributed-work/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1737:\"<p><span class=\"embed-youtube\"></span></p>\n<p>I saw the new Steve Jobs movie a few days ago, which I enjoyed as a movie even though <a href=\"http://daringfireball.net/linked/2015/10/22/mossberg-steve-jobs\">the main elements were fiction and it should have been titled something else</a>.</p>\n<p>But they had an awesome video interview with <a href=\"https://en.wikipedia.org/wiki/Arthur_C._Clarke\">the amazing Arthur C. Clarke</a> in 1974, which I&#8217;ve embedded above, where he said the following right around 0:56.</p>\n<blockquote><p>Interviewer: I wonder though, what sort of a life will it be in social terms if our whole life is built around the computer, if we become a computer-dependent society, computer-dependent individuals.</p>\n<p>ACC: In some ways, but they&#8217;ll also enrich our society because it&#8217;ll make it possible for us to live anywhere we like. Any businessman, any executive could live almost anywhere on earth and still do his business through a device like this, and this is a wonderful thing, it means we won&#8217;t have to be stuck in cities, we can live out in the country or wherever we please, and still carry on complete interaction with human beings, as well as with other computers.</p></blockquote>\n<p>Wow, extremely prescient. Remember, this was 1974! The dominant technology companies of today still follow the same office-centric model as when computers took up entire rooms, but the dominant companies of tomorrow will be built and grow in a completely distributed fashion. (And of course, <a href=\"https://automattic.com/work-with-us/\">we&#8217;re hiring</a>.)</p>\n<p>See also, from 2012: <a href=\"http://ma.tt/2012/09/future-of-work/\">Automattic, Forbes, and the Future of Work</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 10 Nov 2015 22:00:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"WPTavern: More Than 250 Tickets Still Available for WordCamp US\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48902\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://wptavern.com/more-than-250-tickets-still-available-for-wordcamp-us\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2861:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/WordCampUSAFeaturedImage.png\" rel=\"attachment wp-att-32754\"><img class=\"size-full wp-image-32754\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/WordCampUSAFeaturedImage.png?resize=640%2C276\" alt=\"WordCamp USA Featured Image\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/vgrigoriu/363904283/\">vgrigoriu</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-sa/2.0/\">cc</a>\n<p>In a little less than a month, the first annual <a href=\"https://2015.us.wordcamp.org/\">WordCamp US</a> will be underway in Philadelphia, PA. There&#8217;s still <a href=\"https://2015.us.wordcamp.org/tickets/\">251 tickets available</a> to attend the event in person. The <a href=\"https://2015.us.wordcamp.org/schedule/\">schedule and sessions</a> are published and it looks like an informational packed two-day event.</p>\n<p>There are three tracks available, two of which will have typical length sessions with a third track dedicated to lightning talks. I highly encourage you to <a href=\"https://2015.us.wordcamp.org/schedule/\">view the schedule</a> and create a list of sessions to attend as the first day has over 40 of them.</p>\n<p>Reed Gustow, one of the event&#8217;s primary organizers says they&#8217;re expecting a lot of attendees, &#8220;We&#8217;re expecting 2,000 attendees from across the United States and from many other countries, and it will be a wonderful opportunity to learn, share knowledge and meet others in the amazing WordPress community.&#8221;</p>\n<p>In addition to WordCamp US, there will be a <a href=\"https://2015.us.wordcamp.org/2015/11/09/join-us-for-the-wordcamp-us-contributor-day/\">WordPress contributor day</a> on December 6th. During contributor day, people from all walks of life get together and contribute to various parts of the WordPress project whether it&#8217;s the support forums, core code, documentation, and more. Mentors will be on hand to help new contributors.</p>\n<p>Last but not least, the most important information is where to eat a great tasting cheesesteak. After all, it&#8217;s one of the things <a href=\"http://www.visitphilly.com/itineraries/philadelphia/where-to-find-the-best-cheesesteaks-in-philadelphia/\">Philadelphia is known for</a>. The WordCamp US organizing team has you <a href=\"https://2015.us.wordcamp.org/2015/11/09/the-cheesesteak-post/\">covered with a post</a> that describes the different types of cheesesteaks and where to find the best tasting ones.</p>\n<p><a href=\"https://2015.us.wordcamp.org/location/\">Hotel and venue information</a> for the event is on the WordCamp US website. Unfortunately, I&#8217;m not attending the event this year, but <a href=\"http://wptavern.com/contributors\">Sarah Gooding</a> will be there. If you see her, stop her and say hi.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 10 Nov 2015 05:39:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"WPTavern: A Quarter of the Top 10 Million Sites Ranked by Alexa Use WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48885\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"http://wptavern.com/a-quarter-of-the-top-10-million-sites-ranked-by-alexa-use-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4996:\"<p>According to Matthias Gelbmann of <a href=\"http://w3techs.com\">W3Techs</a>, 25% of the <a href=\"http://w3techs.com/blog/entry/wordpress-powers-25-percent-of-all-websites\">sites it surveys</a> are using WordPress. The milestone comes two years after reaching the 20% mark.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/11/QuarterOfTheWebWP.png\" rel=\"attachment wp-att-48888\"><img class=\"size-full wp-image-48888\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/11/QuarterOfTheWebWP.png?resize=557%2C398\" alt=\"Quarter of the Web\" /></a>Quarter of the Web\n<p>The following image shows WordPress&#8217; rapid growth from 13.1% in January 2011 to 25% today.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/11/UsageHistory.png\" rel=\"attachment wp-att-48889\"><img class=\"size-full wp-image-48889\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/11/UsageHistory.png?resize=900%2C298\" alt=\"WordPress\' Growth\" /></a>WordPress&#8217; Growth\n<p>Drupal and Joomla, two other popular open source content management systems combine for 4.9%, slightly less than 1/5th of WordPress.</p>\n<p>W3Techs counts both self hosted WordPress and WordPress.com sites, &#8220;We only count the hosted sites if they are reachable via their own domain (not only as subdomain of wordpress.com), and they must qualify like all other sites in our surveys by getting enough visitors on that separate domain to make it into the top 10 million Alexa sites,&#8221; Gelbmann says.</p>\n<p>This means that only those sites on WordPress.com that use domain mapping and have enough traffic to be in the top 10 million Alexa sites are counted leaving millions of WordPress.com sites uncounted. Only 1.25% of WordPress sites in the survey are hosted at WordPress.com.</p>\n<h2>The Fastest Growing CMS</h2>\n<p>The survey also shows that WordPress is still the fastest growing CMS, &#8220;Every 74 seconds a site within the top 10 million starts using WordPress. Compare this with Shopify, the second-fastest growing CMS, which is gaining a new site every 22 minutes,&#8221; Gelbmann says.</p>\n<p>When sites are broken down into languages, WordPress is used on 37.3% of English language sites. Portuguese, Spanish, Swedish and Turkish sites are inbetween 38-40% while Bengali is 51.3% and 54.4% for Bosnian. Only 10.6% of WordPress sites are in Chinese with 6.9% for Korean.</p>\n<p>About 94% of sites surveyed use a Unix-like operating system such as Ubuntu. Windows servers host 6.2% of WordPress sites making it the most popular CMS running on Windows servers.</p>\n<p>Matt Mullenweg, Co-founder of the WordPress project, says the <a href=\"http://ma.tt/2015/11/seventy-five-to-go/\">largest opportunity for growth</a> is in the 57% of sites not using <em>any</em> identifiable CMS. Earlier this year, we learned that <a href=\"http://wptavern.com/how-important-is-jetpack-on-wordpress-road-to-50-market-share\">Jetpack is going to play a significant role</a> in WordPress gaining 50% or more of market share.</p>\n<p>In an <a href=\"http://kitchensinkwp.com/podcast-e048-interview-with-matt-mullenweg/\" target=\"_blank\">interview with Adam Silver on the KitchensinkWP podcast</a>, Mullenweg explains the path to 50% and beyond.</p>\n<blockquote><p>The next goal is the majority of websites. We want to get to 50%+ and there’s a lot of work between now and then. As the percentage increases, it gets harder and harder to grow the market share, and we have to grow the market share by doing things we haven’t done in the past – really thinking about the onboarding process, really thinking about the integration with social networks, and with how WordPress works on touch devices, which is going to be the predominant computing platform of the future. These things are going to be really important.</p>\n<p>What got us here isn’t going to get us there. Once we get to 50%, we can decide something new we want to do</p></blockquote>\n<p>Automattic is experimenting with a new side project called <a href=\"https://github.com/automattic/jetpack-onboarding\">Jetpack Onboarding</a>. The project is an attempt to improve WordPress&#8217; new user experience. Hosting companies that choose to implement it can modify, add, or remove steps.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/JetpackOnboardingScreen.png\" rel=\"attachment wp-att-48891\"><img class=\"size-full wp-image-48891\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/JetpackOnboardingScreen.png?resize=1025%2C469\" alt=\"Jetpack Onboarding Screen\" /></a>Jetpack Onboarding Wizard\n<p>Keep in mind that W3Techs&#8217; market share numbers are based on the top 10 million sites in Alexa. Fifty percent market share is 5 million of those 10 million sites. Are these the sites WordPress should be targeting with development efforts? Are they more important than the millions of sites not ranked by Alexa? I don&#8217;t think so but only time will tell.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 10 Nov 2015 04:34:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"Matt: AVC On Tracking\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=45572\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"http://ma.tt/2015/11/avc-on-tracking/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:524:\"<blockquote><p>If you listed the habits of successful people, tracking and measuring would be near the top of that list. I see it with people, companies, and teams that I work with. I see it in my own behavior.</p></blockquote>\n<p>Fred Wilson writes on <a href=\"http://avc.com/2015/11/track-and-measure/\">Tracking and Measuring</a>. Lack of measurement &#8212; picking stats and watching them before and after a launch &#8212; is one of the most common mistakes I see product teams make, certainly inside of Automattic.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 09 Nov 2015 23:29:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"Matt: Seventy-Five to Go\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=45568\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"http://ma.tt/2015/11/seventy-five-to-go/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1391:\"<p>People are abuzz because it looks like the <a href=\"http://w3techs.com/\">W3Techs survey</a> of the web <a href=\"http://w3techs.com/technologies/history_overview/content_management/all/y\">now has WordPress at 25% market share</a>.</p>\n<p><a href=\"https://cloudup.com/cys3qUJxyRT\"><img src=\"https://cldup.com/jX4J6C_emK-900x900.png\" alt=\"Screen Shot\" width=\"900\" height=\"298\" /></a></p>\n<p>Sometimes it goes up and down through the course of a month, but it&#8217;s still a pretty fun milestone that we can now say about one in four websites are now powered by the <a href=\"https://wordpress.org/\">scrappy open source underdog</a> with its roots stretching all the way back to a single person in Corsica, France. We should be comfortably past 25% by the end of the year.</p>\n<p>The big opportunity is still the 57% of websites that don&#8217;t use <em>any</em> identifiable CMS yet, and that&#8217;s where I think there is still a ton of growth for us (and I&#8217;m also rooting for all the other open source CMSes).</p>\n<p>If you want to celebrate with us <a href=\"https://2015.us.wordcamp.org/\">come to the first-ever WordCamp US event next month in Philadelphia</a> (tickets still available) &#8212; it&#8217;s shaping up to be an amazing event. We just <a href=\"https://2015.us.wordcamp.org/schedule/\">published the schedule and there are some amazing speakers and sessions</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 08 Nov 2015 13:15:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"WPTavern: How Not to Communicate Grievances with WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48861\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"http://wptavern.com/how-not-to-communicate-grievances-with-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9778:\"<p>A few days ago, <a href=\"http://wptavern.com/how-non-developers-can-contribute-to-and-influence-wordpress-core-development\">I offered advice</a> on how non-developers can contribute to and influence core WordPress development. Communicating online is hard but where and how you communicate affects the likelihood of making an impact.</p>\n<p><a href=\"https://www.cmscritic.com/\">CMS Critic</a> is a site I&#8217;ve read for years as it routinely publishes articles on a variety of content management systems, including WordPress.</p>\n<p>In late October, Kaya Ismail <a href=\"http://www.cmscritic.com/how-wordpress-needs-to-improve-itself/\">published an article</a> that describes how WordPress needs to improve itself in six ways. What could have been a great article, is instead a great example of <strong>how not to</strong> communicate grievances you have with WordPress.</p>\n<h2>Twenty Sixteen Developers Are Lazy</h2>\n<p>Many people, including myself <a href=\"http://wptavern.com/first-look-at-the-twenty-sixteen-default-wordpress-theme#comments\">have an opinion</a> of the Twenty Sixteen theme in WordPress 4.4. Ismail thinks the developers behind the theme are lazy.</p>\n<blockquote><p>I totally understand that WordPress doesn&#8217;t need to compete with the massive library of third-party themes available out there, but that doesn&#8217;t mean that they should lead with a default theme as bad as that. It&#8217;s nothing short of lazy.</p></blockquote>\n<p>Tammie Lister, Takashi Irie, and others continue to work hard on Twenty Sixteen to prepare it for the WordPress 4.4 release in December. They are far from lazy people making Ismail&#8217;s opinion more of an insult. He doesn&#8217;t provide any examples or ideas on what should be in a default theme.</p>\n<h2>The WordPress Plugin Directory</h2>\n<p>According to Ismail, the WordPress plugin directory is filled with large chunks of trash in addition to great plugins. While some plugins in the directory could be coded better, his explanation falls short of describing a solution.</p>\n<blockquote><p>Many plugins simply don&#8217;t work, while many more are poorly put together, which in turn makes WordPress as a platform harder to use. Quality control needs to improve.</p></blockquote>\n<p>He doesn&#8217;t link to plugins that are broken, provide any code samples, or show where quality control is lacking. His statement is an assumption that&#8217;s not backed by evidence.</p>\n<p>Those who <a href=\"http://wptavern.com/behind-the-scenes-in-the-wordpress-plugin-directory-with-mika-epstein\">oversee the plugin directory</a> don&#8217;t test every submitted plugin to make sure it works with WordPress. Among other things, their job is to make sure plugin submissions don&#8217;t have security issues. If the moderators performed quality control on every plugin, the submission queue would likely have a substantial backlog.</p>\n<p>Instead of writing baseless assumptions, Ismail should monitor the <a href=\"https://make.wordpress.org/plugins/\">Make WordPress Plugins</a> site to stay on top of what&#8217;s going on with the plugin directory and submit feedback where necessary. If a broken plugin is discovered, he should create a forum thread within the plugin&#8217;s support area.</p>\n<p>This way, his feedback is seen by those who directly control the WordPress plugin directory. The simple act of reporting a broken plugin to the developer is a major step towards being part of the solution and not the problem.</p>\n<h2>Admin Menu Clutter</h2>\n<p>I agree with Ismail&#8217;s opinion that the WordPress admin menus can become cluttered if the right plugins are activated. At least in this case, he suggests an alternative.</p>\n<blockquote><p>I&#8217;d like to see WordPress group third-party menu options together, in a way that&#8217;s a little more organized and less intrusive. Perhaps this can be done by giving them a sub-section within the menu which can be collapsed. The solution itself is up to them, but the problem is evident.</p></blockquote>\n<p>There <a href=\"https://codex.wordpress.org/Administration_Menus\">are guidelines</a> for when plugin developers should create top-level or sub-level menu items but they&#8217;re not followed as well as they could be. Without strictly enforcing these guidelines, it&#8217;s out of WordPress&#8217; hands. The complaint is aimed in the wrong direction and should point towards third-party developers, not WordPress itself.</p>\n<p>If you want more control in how items are displayed in the admin menu, I recommend using the <a href=\"https://wordpress.org/plugins/menu-humility/\">Menu Humility</a> plugin by Mark Jaquith.</p>\n<h2>Akismet is Not Enough</h2>\n<p>According to Ismail, comment spam is a major issue with WordPress sites and Akismet doesn&#8217;t do enough to stop it.</p>\n<blockquote><p>Akismet, a spam comment filter, now comes with every WordPress install &#8211; which is a good thing. But the free version doesn&#8217;t do enough for me, as comments still pile up in the back end. If you ask me, WordPress needs to find another way to turn the unrelenting tide of spam.</p></blockquote>\n<p>To clarify, Akismet has been bundled with WordPress since <a href=\"https://wordpress.org/news/2005/12/wp2/\">version 2.0</a> and there&#8217;s no difference between the free and commercial versions in how Akismet protects sites. He doesn&#8217;t provide any suggestions on what WordPress could do to thwart spam but says it has to do something.</p>\n<p>What are members of the WordPress core team supposed to do with this kind of feedback? It&#8217;s not helpful, doesn&#8217;t provide any ideas, and is easy to discard.</p>\n<h2>Updates are Hard</h2>\n<p>Depending on your webhost&#8217;s configuration, updating themes, plugins, and WordPress is as simple as clicking a button. For the more adventurous, you can configure them to happen automatically. For Ismail, the update process is difficult.</p>\n<blockquote><p>Updating a plugin may cause conflicts between it and another plugin. Updating a theme can erase your modifications (unless you use a child theme), whereas updating WordPress itself can render a variety of your plugins redundant until their developers apply a patch. Confused yet? You should be.</p></blockquote>\n<p>He makes a few good points but editing a theme instead of a child theme is like editing WordPress core files which should almost never happen. It&#8217;s true that there is a slight risk of <a href=\"http://wptavern.com/plugin-developers-demand-a-better-security-release-process-after-wordpress-4-2-3-breaks-thousands-of-websites\">things breaking</a> after an update but it&#8217;s more of an anomaly than a common occurrence.</p>\n<p>Ismail suggests that WordPress look into preserving theme changes across the board and to provide alerts if  plugins interfere with each other. I like these suggestions and my hope is that one day, WordPress will be able to create a snapshot during the update process to provide assurance that the site won&#8217;t break after an update is applied.</p>\n<h2>WordPress Hack-a-thon</h2>\n<p>Ismail&#8217;s last point is how WordPress can improve its security.</p>\n<blockquote><p>I think we can all agree that WordPress needs to beef itself up (by shoring up its admin login page, for example), but I call for it to go a step further and start offering better protection, even if it comes at a small price.</p>\n<p>Third party solutions exist, sure. But why should I have to patch together several security plugins, each with their own confusing settings, just to secure my website? Many WordPress users have become accustom to handling their own security in this way; but I think WordPress needs to take on more responsibility.</p></blockquote>\n<p>He wants WordPress to go a step further and offer better protection but doesn&#8217;t say what that protection is. He also doesn&#8217;t explain where, how, or why WordPress should take on more responsibility to make sites more secure.</p>\n<h2>Be Part of the Solution, Not the Problem</h2>\n<p>Ismail concludes his article by saying it&#8217;s time for WordPress to innovate. He also says, &#8220;The onus isn&#8217;t on me to provide the solution, it&#8217;s upon WordPress. And it&#8217;s about time they started coming up with innovative solutions for their long-standing issues.&#8221;</p>\n<p>The article is <a href=\"https://www.cmscritic.com/wordpress-4.4-beta-bare-bones/\">another example</a> of how CMS Critic chooses not to be part of the solution. Everyone is entitled to their opinions, but airing grievances which sound more like demands and telling core developers to start innovating is not a recipe for results.</p>\n<p><a href=\"http://www.smashingmagazine.com/2013/05/contributing-to-wordpress/\">This quote</a> from WordPress core developer, Mark Jaquith, eloquently describes how important communication skills are in an open source project.</p>\n<blockquote><p>The number one skill you need for just about any job, but specifically working on open source, is communication skills. You need to have clarity, consistency, compassion, relatability, a little bit of a thick skin and a decent sense of humor.</p></blockquote>\n<p>The onus may not be on Ismail or any of us to come up with solutions, but he and others can help discover and be part of solutions by taking an active role in giving constructive feedback in <a href=\"http://hughlashbrooke.com/2015/11/03/a-non-developers-guide-to-getting-involved-in-wordpress-core-development/\">the right place</a>. WordPress has its fair share of issues but there are <a href=\"http://www.smashingmagazine.com/2013/05/contributing-to-wordpress/\">plenty of opportunities</a> for people to step up and contribute to make the software better.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 06 Nov 2015 18:52:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"WPTavern: Jetpack 3.8 Adds Google+ Badges and Fixes Contact Form Response Emails\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48853\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"http://wptavern.com/jetpack-3-8-adds-google-badges-and-fixes-contact-form-response-emails\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3200:\"<p>Jetpack 3.8 is <a href=\"http://jetpack.me/2015/11/04/jetpack-3-8-google-badges-and-more/\">available for download</a> and includes, Google+ badges, Twitch.TV embed shortcode, improvements to the contact form module, and bug fixes.</p>\n<p>Users can now display a Google+ Badge widget that shows your Google+ profile, page, or community.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/GooglePlusBadgeSettings.png\" rel=\"attachment wp-att-48854\"><img class=\"size-full wp-image-48854\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/GooglePlusBadgeSettings.png?resize=443%2C493\" alt=\"Google Plus Badge Settings\" /></a>Google Plus Badge Settings\n<p>You can configure the badge&#8217;s width, layout, and choose between a light or dark color scheme. A Google+ icon has also been added to the Social Media Icons widget bringing the total number of available icons to nine.</p>\n<p>Those who use the Shortcode Embeds module can now easily embed videos from <a href=\"http://www.twitch.tv/\">Twitch.tv</a> using the <a href=\"https://en.support.wordpress.com/videos/twitch-tv-shortcode/\">[ twitchtv ] shortcode</a>. The shortcode&#8217;s attributes allow you to modify the width, height, and whether or not the video autoplays.</p>\n<p>In previous versions of Jetpack, the Contact Form module checkbox field type was limited to a single item. In Jetpack 3.8, check box field types can have multiple items.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/11/JetpackContactFormMultipleFields.png\" rel=\"attachment wp-att-48855\"><img class=\"size-full wp-image-48855\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/11/JetpackContactFormMultipleFields.png?resize=746%2C713\" alt=\"Multiple Options Field\" /></a>Multiple Options Field\n<p>One of my favorite enhancements in Jetpack 3.8 is the improved styling to contact form email responses. In previous versions of Jetpack, emails <a href=\"https://github.com/Automattic/jetpack/issues/49\">didn&#8217;t match the order of the fields</a> within the contact form. Now, any responses to the contact form will show up in the order you set.</p>\n<p>Other notable improvements in Jetpack 3.8 include:</p>\n<ul>\n<li>Lots of new filters to allow further customization of Jetpack.</li>\n<li>Better error messaging for Subscription Widget sign up forms.</li>\n<li>Improvements and enhancements to accessibility.</li>\n</ul>\n<p>In addition to features and bug fixes, this release contains contributions from Daisuke Takahashi and Eduardo Reveles. Takahashi lives in Japan and is responsible for the Google+ Badge Widget. Reveles not only filed a <a href=\"https://github.com/osiux\">substantial amount of issue reports on Github</a> but also submitted a lot of patches.</p>\n<p>These two are among a group of more than 40 people who worked on Jetpack 3.8. Check out Jetpack&#8217;s <a href=\"http://jetpack.me/contribute/\">contribute page</a> if you&#8217;d like to get involved with the project. Also, be sure to read how you can <a href=\"http://wptavern.com/jetpack-relaunches-beta-testing-program\">join the Jetpack beta testing team</a> to be among the first to test new features.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 06 Nov 2015 07:12:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Matt: Most Miles of Road: Texas\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=45563\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"http://ma.tt/2015/11/most-miles-of-road-texas/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:405:\"<p>I was wondering the other day how many miles of road were in every state, and guessed that Texas must be the highest. It turns out it is, <a href=\"http://blog.cubitplanning.com/2010/02/road-miles-by-state/\">according to this list of the road mileage of every state</a>. It&#8217;s about 70% more than the runner-up, California. After TX and CA, it&#8217;s Illinois, Kansas, Minnesota, and Missouri.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 05 Nov 2015 16:20:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"WPTavern: Justin Tadlock Explains Taxonomy Term Meta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48843\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"http://wptavern.com/justin-tadlock-explains-taxonomy-term-meta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1323:\"<p>While developers celebrate the <a href=\"http://wptavern.com/the-first-half-of-the-rest-api-is-officially-added-to-wordpress-core\">first half of the WordPress REST API</a> being merged into WordPress, there&#8217;s also another reason to celebrate. Six years <a href=\"https://core.trac.wordpress.org/ticket/10142\">in the making</a>, taxonomy term meta <a href=\"https://make.wordpress.org/core/2015/10/23/4-4-taxonomy-roundup/\">will be available</a> in WordPress 4.4.</p>\n<p>If you&#8217;re like me and don&#8217;t have a clue as to what taxonomy term meta is, I highly encourage you to read Justin Tadlock&#8217;s <a href=\"http://themehybrid.com/weblog/introduction-to-wordpress-term-meta\">explanation and tutorial</a>. In the post, Tadlock explains why term meta is significant and some of the possibilities it affords developers.</p>\n<p>After reading through the tutorial, I have a better understanding as to why developers are so excited. Not only does it create more opportunities to extend WordPress, but does so in a standard and expected way. Previous to WordPress 4.4, developers had to rely on work-arounds to add term meta to taxonomies.</p>\n<p>Let us know what you think of the tutorial and how you plan to take advantage of this feature once WordPress 4.4 is released.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 05 Nov 2015 08:45:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"WPTavern: Easily Add Citations to Quotes With the Better Blockquotes Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48833\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"http://wptavern.com/easily-add-citations-to-quotes-with-the-better-blockquotes-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2123:\"<p><a href=\"https://github.com/devinsays/better-blockquotes\">Better Blockquotes</a> is a free WordPress plugin created by <a href=\"http://wptheming.com/\">Devin Price</a> that makes it easy to add citations to blockquotes. When a user clicks the blockquote button with no text highlighted, a dialogue box pops up with options to add a quote, citation, and a citation link.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/BetterBlockquoteOptions.png\" rel=\"attachment wp-att-48834\"><img class=\"size-full wp-image-48834\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/BetterBlockquoteOptions.png?resize=448%2C307\" alt=\"Better Blockquote Options\" /></a>Better Blockquote Options\n<p>Citations are inserted into the post with HTML5 markup. The blockquote button retains its default behaviour with highlighted text. I tested the plugin on WordPress 4.4 beta 3 and it works as advertised.</p>\n<p>I did notice however, that the citation displays immediately after the last character in the quote. I&#8217;d prefer to have</p>\n<p>a space between the last character and the citation.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/11/BetterBlockquotesVisualEditor.png\" rel=\"attachment wp-att-48835\"><img class=\"size-full wp-image-48835\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/11/BetterBlockquotesVisualEditor.png?resize=593%2C321\" alt=\"Better Blockquotes in the Visual Editor\" /></a>Better Blockquotes in the Visual Editor\n<p>An example of how better blockquotes looks in a post.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/BetterBlockquotesInaPost.png\" rel=\"attachment wp-att-48836\"><img class=\"size-full wp-image-48836\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/BetterBlockquotesInaPost.png?resize=605%2C195\" alt=\"How a Blockquote Looks in a Post\" /></a>How a Better Blockquote Looks in a Post\n<p>Based on feedback, Price says he&#8217;ll attempt to add it to WordPress core as an enhancement. Is better blockquotes something you&#8217;d like to see added to WordPress?</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 05 Nov 2015 00:08:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"Matt: Journalistic Accountability\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=45560\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"http://ma.tt/2015/11/journalistic-accountability/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:522:\"<p>Tech blog idea: A site that covers the top headlines on <a href=\"http://techmeme.com/\">Techmeme</a> 6, 12, or 18 months after they happened, and explores the delta between what people said was going to happen when they raised funding, or did an acquisition, and what actually happens after time has run its course. We keep covering announcements like they matter. Can also compare analyst and commentator predictions for <a href=\"https://duckduckgo.com/?q=site%3Adaringfireball.net+claim+chowder\">claim chowder</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 04 Nov 2015 15:01:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"WPTavern: How Non-Developers Can Contribute to and Influence WordPress Core Development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48823\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"http://wptavern.com/how-non-developers-can-contribute-to-and-influence-wordpress-core-development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1995:\"<p>If you don&#8217;t consider yourself a developer and want to contribute to WordPress core, <a href=\"http://hughlashbrooke.com/2015/11/03/a-non-developers-guide-to-getting-involved-in-wordpress-core-development/\">Hugh Lashbrooke&#8217;s guide</a> offers a few different techniques. The guide explains how and where to provide feedback and how important it is to beta test new features.</p>\n<p>Over the years, I&#8217;ve used WP Tavern to advocate for and against features in WordPress. One of the best pieces of advice I can give non-developers is to organize your thoughts or stance on a specific feature or direction and publish them on your site. This allows you to control the conversation and gives you plenty of space to explain your perspective.</p>\n<p>A great example <a href=\"http://wptavern.com/help-me-add-comment-approval-notifications-to-wordpress\">is this post</a> asking for help to add comment moderation approval notifications to WordPress. I explain why it&#8217;s needed with a <a href=\"https://core.trac.wordpress.org/ticket/33717\">link to the ticket</a> I created to keep track of the conversation. I prefer to write about potential features and based on feedback, I&#8217;ll either create a trac ticket myself or someone will do it for me with a link to the post.</p>\n<p>The Tavern is in the dashboard and is read by a large audience, including core developers. However, thanks to social media, a well constructed post with solid points will make the rounds on Twitter, Facebook, and within WordPress sub-communities.</p>\n<p>It&#8217;s those posts and associated comments that serve as one of many foundations for change in WordPress without touching a line of code. Keep in mind that there&#8217;s no guarantee you&#8217;ll be able to directly influence WordPress core development with words alone, but respectful, in-depth conversations with differing opinions and perspectives are an important part of the community regardless.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 04 Nov 2015 08:42:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"WPTavern: Daniel Bachhuber Raises More Than $17.5K to Develop a RESTful WP-CLI\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48819\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"http://wptavern.com/daniel-bachhuber-raises-more-than-17-5k-to-develop-a-restful-wp-cli\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1664:\"<p><a href=\"https://danielbachhuber.com/\">Daniel Bachhuber</a>, who maintains <a href=\"http://wp-cli.org/\">WP-CLI</a>, has successfully raised more than $21K through his <a href=\"https://www.kickstarter.com/projects/danielbachhuber/a-more-restful-wp-cli\">Kickstarter campaign</a>. He created the campaign to generate funding to develop a CLI interface for the WordPress REST API.</p>\n<p>According to Bachhuber, the project will allow WordPress REST API endpoints registered via plugins and themes to automatically be usable as WP-CLI commands. Developers will also be able to push and pull posts including, custom post types, users, and other WordPress REST API data between separate WordPress installations with a simple WP-CLI command.</p>\n<p>Bachhuber requested $17.5K and within twelve hours of publishing the campaign, he received more than the asking amount from 51 backers, including one who contributed $8,500. Bachhuber will donate one hour of time to the WordPress REST API project in 2016 for every $100 over the funding goal. Based on the current amount, that&#8217;s 46 hours.</p>\n<p>With funding in place, Bachhuber will work on the project throughout the first half of 2016, &#8220;$17,500 represents 150 hours of development at $100/hour, plus Kickstarter&#8217;s cut and costs associated with the rewards. I intend to use this time over the first six months of 2016,&#8221; he said.</p>\n<p>There&#8217;s still 28 days left in the campaign and if it reaches $40K, he pledges to help figure out how the REST API will handle <a href=\"https://github.com/WP-API/WP-API/issues/1055\">password protected posts</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 04 Nov 2015 07:04:49 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"WPTavern: 93Digital Publishes WordPress Time Machine\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48814\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"http://wptavern.com/93digital-publishes-wordpress-time-machine\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1528:\"<p><a href=\"https://93digital.co.uk/\">93Digital</a>, a London-based WordPress development agency, has published a <a href=\"https://93digital.co.uk/wphistory/\">WordPress time machine</a>. The page features a timeline where visitors can browse every major version of WordPress released since 1.0. Versions are displayed in a horizontal timeline format with fancy animations when hovered over.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/WordPresstimeMachine.png\" rel=\"attachment wp-att-48815\"><img class=\"size-full wp-image-48815\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/11/WordPresstimeMachine.png?resize=1025%2C554\" alt=\"WordPress Time Machine\" /></a>WordPress Time Machine\n<p>Unfortunately, the animations are more distracting than they are useful and add a small delay when viewing images. The full-size images are not large enough and appear blurry when clicked on. If 93Digital removes the animations and uses larger images, the timeline would be a nice way to visually browse through WordPress&#8217; history.</p>\n<p>If you&#8217;d like to see clear, large images of past WordPress releases and learn about some of the key features in each version, I recommend reading <a href=\"http://www.inmotionhosting.com/support/website/wordpress/wordpress-through-the-ages\">WordPress through the ages</a>. Through the images, you can see the natural progression of features, designs, and layouts WordPress has gone through during the past 10 years.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 03 Nov 2015 18:18:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:19:\"Matt: Mario and NUX\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=45552\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"http://ma.tt/2015/11/mario-and-nux/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:734:\"<p><span class=\"embed-youtube\"></span></p>\n<p>In this video Shigeru Miyamoto and Takashi Tezuka discuss World 1-1, or the very first level in the very first Super Mario Bros. It&#8217;s fascinating how every element on the level is designed to introduce you to a mechanic of the game, or how Mario moves and jumps. This is interesting if you like Mario, but also important for any developer in any medium who is thinking about the NUX (new user experience) of their product. I sometimes joke that in <a href=\"http://wordpress.org/\">WordPress</a> we put people on the boss monster level the first time they enter the dashboard. There have been improvements but still so much to do to naturally introduce people to our interface.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 02 Nov 2015 15:26:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"Matt: Fixing DST\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=45543\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"http://ma.tt/2015/11/fixing-dst/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:230:\"<p>The Atlantic: <a href=\"http://www.theatlantic.com/business/archive/2013/11/daylight-saving-time-is-terrible-heres-a-simple-plan-to-fix-it/281075/\">Daylight Saving Time Is Terrible: Here&#8217;s a Simple Plan to Fix It</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 01 Nov 2015 17:59:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"WPTavern: WordPress 4.4 Streamlines Content Sharing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48797\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"http://wptavern.com/wordpress-4-4-streamlines-content-sharing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4151:\"<p>For the last six years, WordPress has been an <a href=\"https://codex.wordpress.org/Embeds\">oEmbed consumer</a>, adding support for services with nearly every major release since 2.9. In WordPress 4.4, it switches roles and is an oEmbed provider.</p>\n<p>Proposed by Pascal Birchler <a href=\"https://make.wordpress.org/core/2015/09/30/feature-plugin-merge-proposal-oembed/\">earlier this year</a>, oEmbeds for posts streamlines how they&#8217;re shared across the web. Here&#8217;s an example of what an oEmbedded post looks like.</p>\n<p></p>\n<p>Content is displayed in an iFrame with a link to comments, a sharing button, and a link to the main page the article is hosted on. The continue reading link takes visitors to the source site. In the last three months, Birchler and members of the core team have worked hard to make sure embedded content is secure.</p>\n<ul>\n<li>The iFrames use the <a href=\"https://developer.mozilla.org/en/docs/Web/HTML/Element/iframe#Attributes\">sandbox attribute</a> to enable extra restrictions on content that can appear in the inline frame.</li>\n<li>The host and the embedded site communicate via postMessage to allow resizing and clicking on links safely</li>\n</ul>\n<p>oEmbed discovery is turned on by default in WordPress 4.4. Too disable it, you&#8217;ll need install and activate the <a href=\"https://wordpress.org/plugins/disable-embeds/\">Disable Embeds</a> plugin. The plugin does the following:</p>\n<ul>\n<li>Prevents others from embedding your site.</li>\n<li>Prevents you from embedding other non-whitelisted sites.</li>\n<li>Disables all JavaScript</li>\n</ul>\n<p>Some people <a href=\"https://make.wordpress.org/core/2015/10/28/new-embeds-feature-in-wordpress-4-4/#comment-28263\">are requesting</a> that an option be added to disable oEmbeds rather than installing a plugin. In response to requests, Aaron Jorbin, WordPress core contributor, reemphasized <a href=\"https://wordpress.org/about/philosophy/#decisions\">WordPress&#8217; philosophy</a> on adding options.</p>\n<blockquote><p>Every time you give a user an option, you are asking them to make a decision. When a user doesn’t care or understand the option this ultimately leads to frustration. As developers we sometimes feel that providing options for everything is a good thing, you can never have too many choices, right?</p>\n<p>Ultimately these choices end up being technical ones, choices that the average end-user has no interest in. It’s our duty as developers to make smart design decisions and avoid putting the weight of technical choices on our end users.</p></blockquote>\n<p>Birchler also responded saying, &#8220;The new embed functionality was developed with the majority of users in mind.&#8221; One of the largest problems with adding to options to WordPress is that they&#8217;re difficult to remove.</p>\n<p>Some WordPress developers are excited to see how post embeds can be extended. <a href=\"http://hughlashbrooke.com/\">Hugh Lashbrooke</a>, who works for Automattic, thinks post embeds will be great for Custom Post Types, &#8220;I think the oEmbed feature has loads of awesome use cases for Custom Post Types. For example, being able to embed eCommerce products on other sites with dynamic add to cart links,&#8221; he said.</p>\n<p>The easiest way to try post embeds is to log into <a href=\"http://wptavern.com/test-new-wordpress-features-without-installing-anything-via-trywpbeta\">TryWPBeta</a> using these credentials.</p>\n<ul>\n<li><strong>Username</strong>: wcpdx</li>\n<li><strong>Password</strong>: wcpdx15</li>\n</ul>\n<p>Create a new post and make sure the visual editor is selected. Copy a URL from one of the Make Core WordPress blog posts and paste it into the editor.</p>\n<p>If you&#8217;d like to learn more about how this feature works, check out <a href=\"https://make.wordpress.org/core/2015/10/28/new-embeds-feature-in-wordpress-4-4/\">Birchler&#8217;s post</a> where he explains what developers need to take note of and how to customize the output. WordPress 4.4 is <a href=\"https://make.wordpress.org/core/version-4-4-project-schedule/\">scheduled for release</a> in December.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 30 Oct 2015 20:50:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"Matt: Lifehacker Japan\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=45539\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"http://ma.tt/2015/10/lifehacker-japan/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:301:\"<p>When I was last in Tokyo <a href=\"http://www.lifehacker.jp/2015/10/151022wordpress_matt.html\">I sat down with Lifehacker Japan and they have a long interview in Japanese and some photos from the trip</a>. I don&#8217;t remember what I said, but the Google Translate version is pretty hilarious.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 30 Oct 2015 20:11:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: WPWeekly Episode 211 – Kyle Maurer Co-founder of Real Big Marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48791\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"http://wptavern.com/wpweekly-episode-211-kyle-maurer-co-founder-of-real-big-marketing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2590:\"<p>In this episode, <a href=\"http://marcuscouch.com/\">Marcus Couch</a> and I are joined by Kyle Maurer, Co-founder of <a href=\"http://realbigmarketing.com/\">Real Big Marketing. </a>Maurer grew up in rural Michigan working on farms without much knowledge of the IT industry. He registered an account on meetup.com after discovering a WordPress meetup in his local area.</p>\n<p>During the meetup, Maurer discovered how powerful WordPress is. The knowledge he gained motivated him to dive deep into WordPress and eventually start his own development agency.</p>\n<p>We discuss his most recent project, <a href=\"http://wordcrash.net/\">WordCrash,</a> which allows people in the WordPress community to offer travelers a place to stay for free. We also discuss his involvement with <a href=\"http://wordpress.tv/\">WordPress.TV</a> where Maurer volunteers to moderate videos, contribute code to the site, and coordinate projects. Last but not least, we discuss <a href=\"http://wproundtable.com/\">WP Roundtable</a>, a weekly WordPress podcast hosted by Maurer and a <a href=\"http://wproundtable.com/panel/\">panel of WordPress personalities</a>.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"https://wordpress.org/news/2015/10/wordpress-4-4-beta-2/\">WordPress 4.4 Beta 2 Released</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/media-deduper/\">Media DeDuper</a> saves disk space and brings some order to the chaos of your media library by removing and preventing duplicate files.</p>\n<p><a href=\"https://wordpress.org/plugins/feature-request/\">Feature Request</a> is an advanced feature request and suggestion submitter with a built-in voting system for WordPress.</p>\n<p><a href=\"https://wordpress.org/plugins/minimum-dimensions-for-image-field/\">Minimum Dimensions For Image Field</a> allows the user to set size constraints for the Featured Image field.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, November 4th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #211:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 30 Oct 2015 16:50:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WPTavern: Joe McGill Explains How Responsive Images Work in WordPress 4.4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48780\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"http://wptavern.com/joe-mcgill-explains-how-responsive-images-work-in-wordpress-4-4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2895:\"<p>One of the key features in WordPress 4.4 is <a href=\"https://make.wordpress.org/core/2015/09/30/responsive-images-merge-proposal/\">responsive images</a>. Joe McGill, who is helping to merge the feature to core, joined me for a thirty minute interview to explain how it works.</p>\n<p>When users upload images in WordPress, it automatically crops new images to smaller sizes. For example, if you upload an image that&#8217;s 1500 x 706, the image sizes might look like this:</p>\n<ul>\n<li>Full Size &#8211; 1500 x 706</li>\n<li>Large &#8211; 500 x 235</li>\n<li>Medium &#8211; 300 x 141</li>\n<li>Thumbnail &#8211; 150 x 150</li>\n</ul>\n<p>Additional sizes are created depending on the theme. If the full size image is attached to a post, users on desktop and mobile devices will see the full size image. However, it doesn&#8217;t make sense to use the full size image on mobile devices because of its display and file size.</p>\n<p>Responsive images in WordPress 4.4 adds <code>srcset</code>&nbsp;and <code>sizes</code> support to WordPress. This allows the software to automatically use and display the right image based on a device&#8217;s screen size. If I attach a full size 1500 x 706 image to a post in WordPress 4.4, mobile devices will see the large or medium-sized image instead.</p>\n<p>Responsive images don&#8217;t have any settings to configure as the magic happens behind the scenes. I encourage you to listen to the interview as it may be easier to understand listening to us talk through the feature.</p>\n<div class=\"audio-shortcode-wrap\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/10/ResponsiveImagesinWordPress.png?resize=175%2C131\" alt=\"Responsive Images in WordPress\" class=\"landscape thumbnail post-thumbnail audio-image\" /><!--[if lt IE 9]><script>document.createElement(\'audio\');</script><![endif]-->\n<a href=\"http://wptavern.com/wp-content/uploads/2015/10/Joe-McGill-Explains-Responsive-Images-in-WordPress.mp3\">http://wptavern.com/wp-content/uploads/2015/10/Joe-McGill-Explains-Responsive-Images-in-WordPress.mp3</a></div><div class=\"media-shortcode-extend\"><div class=\"media-info audio-info\"><ul class=\"media-meta\"><li><span class=\"prep\">Run Time</span> <span class=\"data\">26:50</span></li><li><span class=\"prep\">Artist</span> <span class=\"data\">Jeff Chandler</span></li><li><span class=\"prep\">File Name</span> <span class=\"data\"><a href=\"http://wptavern.com/wp-content/uploads/2015/10/Joe-McGill-Explains-Responsive-Images-in-WordPress.mp3\">Joe-McGill-Explains-Responsive-Images-in-WordPress.mp3</a></span></li><li><span class=\"prep\">File Size</span> <span class=\"data\">12.09 MB</span></li><li><span class=\"prep\">File Type</span> <span class=\"data\">MP3</span></li><li><span class=\"prep\">Mime Type</span> <span class=\"data\">audio/mpeg</span></li></ul></div><button class=\"media-info-toggle\">Audio Info</button></div>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 29 Oct 2015 00:43:12 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"WPTavern: The WordPress Theme Directory No Longer Counts Automated Downloads\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48766\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"http://wptavern.com/the-wordpress-theme-directory-no-longer-counts-automated-downloads\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5745:\"<p>The <a href=\"https://wordpress.org/themes/browse/popular/\">popular themes page</a> on the WordPress theme directory usually displays a mix of default themes and those that meet a certain criteria. While the criteria to reach the page is not publicly known, download counts are one form of measurement.</p>\n<p>Since September, the <a href=\"https://wordpress.org/themes/swift/\">Swift theme</a> has routinely shown up on the popular themes page. According to download stats, Swift was downloaded between, 2,000 to 3,500 times a day in September and early October.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/10/SwiftThemeDownloadNumbers.png\"><img class=\"size-full wp-image-48767\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/10/SwiftThemeDownloadNumbers.png?resize=665%2C500\" alt=\"Swift Download Count\" /></a>Swift Download Count\n<p>However, the stats drop off abruptly on October 15th and have yet to reach previous levels. On October 18th, a few members inside the Theme Review Team Slack channel <a href=\"https://wordpress.slack.com/archives/themereview/p1445155458000095\">shared suspicions</a> that something was not right with Swift&#8217;s download stats.</p>\n<p>Ionut Neagu discovered that Swift does not appear on the <a href=\"https://garage.godaddy.com/top-100-wordpress-themes/\">GoDaddy Hot 100</a> while other themes on the popular page do. While not conclusive, the evidence points towards some sort of anomaly.</p>\n<p>Samuel &#8216;Otto&#8217; Wood, who helps maintain WordPress.org <a href=\"https://wordpress.slack.com/archives/themereview/p1445180169000105\">looked at the raw</a> data for Swift and discovered that a lot of the downloads appeared to be automated.</p>\n<blockquote><p>The swift theme is indeed getting an exceptional number of downloads, so I took a closer look at the raw data. It appears that a lot of these downloads are automated in some way. However, there&#8217;s no evidence that it is malicious, nor does the pattern apply only to the swift theme. Perhaps it is included in some installer system that auto-downloads themes for newly installed sites. It&#8217;s hard to say.</p>\n<p>In any case, I made a way to detect and block these types of automated downloads from appearing in the stats, and retroactively applied it for the last three days of data (which is all we retain). Going forward, automated downloads will not appear as downloads and will not affect the popular listings.</p></blockquote>\n<p>Once the changes were implemented, Swift&#8217;s download stats significantly decreased. The changes also apply to all other themes hosted on the directory. Otto declined to comment on the specific changes made but tells the Tavern, &#8220;If we can detect a case where downloads aren&#8217;t being made by users, then we will try not to count it in the results.&#8221;</p>\n<h2>Swift’s Side of the Story</h2>\n<p>Satish Gandham, founder of <a href=\"https://swiftthemes.com/\">Swiftthemes</a>, explains what Swift has gone through the last few weeks which may account for the high download numbers, &#8220;Swift was featured for a couple of days and we spent money on Facebook ads to promote the free version. Also, there were a couple of hosted WordPress providers who asked permission to include Swift on their platform.</p>\n<p>&#8220;The premium version of Swift also had the same slug URL as the free version. The WordPress theme directory saw v7.2.48 to be higher than 7.2.6 and premium users downgraded to the free version thinking it was an upgrade. It was a support nightmare,&#8221; Gandham tells the Tavern.</p>\n<p>Swift&#8217;s <a href=\"https://swiftthemes.com/forums/topic/how-to-returning-to-version-7-2-6/\">support forums</a> confirm that some customers of the commercial version were automatically updated to the free version in early August.</p>\n<h2>Download Counts are Almost Irrelevant</h2>\n<p>When the <a href=\"http://wptavern.com/wordpress-plugin-directory-launches-new-design\">plugin directory was redesigned</a> earlier this year, download counts were removed in favor of active installs. Active installs are more accurate and difficult to manipulate. On the other hand, when the <a href=\"http://wptavern.com/wordpress-theme-directory-launches-new-design\">theme directory was redesigned</a>, download counts remained.</p>\n<p>It&#8217;s possible that the theme directory will one day show active installs but the data gathering aspect is not ready yet. Also, the numbers are lower for themes than for plugins, which may lead to incorrect conclusions in regards to relative popularity.</p>\n<h2>It Happens More Than You Might Think</h2>\n<p>In this particular instance, there&#8217;s no evidence that points to a malicious intent to inflate stats to manipulate the popular themes page. In the years I&#8217;ve written about WordPress, I&#8217;ve heard rumors that certain plugins and themes automate their download counts to appear more popular than they really are. However, I&#8217;ve yet to write about a theme or plugin caught in the act.</p>\n<p>According to Otto, it happens more often than you might think. When he or other volunteer moderators for the plugin and theme directories notice fishy download counts, they contact the author and the process usually stops. If it continues, the author risks having their themes and plugins suspended or banned from the directory.</p>\n<p>If you notice suspicious activity with a theme hosted on WordPress.org, you can voice your concern in the <a href=\"https://make.wordpress.org/chat/\">Theme Review Slack</a> channel during non-meeting times. For suspicious activity related to plugins hosted on the directory, email <strong>plugins at WordPress.org</strong>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 28 Oct 2015 20:23:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"Post Status: Using WordPress as an application framework — Draft podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=14800\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"https://poststatus.com/using-wordpress-as-an-application-framework-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2245:\"<p>Welcome to the Post Status Draft podcast, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a> and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Brian and his co-host, <a href=\"https://twitter.com/joe_hoyle\">Joe Hoyle</a>, a co-founder and the CTO of <a href=\"https://hmn.md/\">Human Made</a>, discuss some of today’s hottest, current WordPress news.</p>\n<p>In this episode of Draft, Joe and Brian discuss a popular site’s redesign, and how the developers viewed WordPress’s shortcomings. They also talk about WordPress’s chops generally for complex sites and applications.</p>\n<p><a href=\"https://audio.simplecast.fm/19270.mp3\">https://audio.simplecast.fm/19270.mp3</a><br />\n<a href=\"https://audio.simplecast.fm/19270.mp3\">Direct Download</a></p>\n<p><strong>Topics:</strong></p>\n<h3>An outside look at WordPress</h3>\n<ul>\n<li><a href=\"https://poststatus.com/notes/wordpress-shortcomings-from-developers-that-prefer-other-software/\">WordPress shortcomings, from developers that prefer other software</a></li>\n<li><a href=\"http://responsivewebdesign.com/toast/backend/\">Redesigning The Toast</a></li>\n<li><a href=\"http://upstatement.com/timber/\">Timber, Twig templating for WordPress</a></li>\n<li><a href=\"http://blog.apps.chicagotribune.com/2011/10/19/turning-wordpress-into-a-framework-with-mtv/\">WordPress MTV</a></li>\n<li><a href=\"http://www.advancedcustomfields.com/\">Advanced Custom Fields </a></li>\n<li><a href=\"http://cmb2.io/\">CMB2</a></li>\n</ul>\n<h3>WordPress as an application framework</h3>\n<ul>\n<li><a href=\"https://pippinsplugins.com/series/building-a-database-abstraction-layer/\">Building a database abstraction layer</a></li>\n<li><a href=\"https://nomadbase.io/\">Nomad Base</a></li>\n<li><a href=\"https://github.com/10up/ElasticPress\">ElasticPress, by 10up</a></li>\n<li><a href=\"https://github.com/alleyinteractive/searchpress\">SearchPress, by Alley</a></li>\n<li><a href=\"https://developer.wordpress.com/docs/elasticsearch/\">Elasticsearch on WordPress.com</a></li>\n<li><a href=\"https://vip.wordpress.com/2015/07/08/scaling-wp-queries-with-elasticsearch/\">Scaling WP queries with Elasticsearch</a></li>\n</ul>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 28 Oct 2015 04:05:24 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Katie Richards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"WPTavern: ManageWP Launches Orion Dashboard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48756\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"http://wptavern.com/managewp-launches-orion-dashboard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2334:\"<p>If you use <a href=\"https://managewp.com/\">ManageWP</a>, you may have noticed a new dashboard design. That&#8217;s because the <a href=\"https://managewp.com/developer-diary-9-managewp-orion-is-out\">company released Orion</a>, a completely redesigned dashboard for managing sites.</p>\n<p>To give users a chance to alter workflows and explore the Orion dashboard, ManageWP linked the original dashboard to Orion. Actions performed in one dashboard are mirrored to the other. Users can switch between the two with the click of a button.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/10/ManageWPOrianOldNew.gif\"><img class=\"size-full wp-image-48757\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/10/ManageWPOrianOldNew.gif?resize=638%2C512\" alt=\"ManageWP Dashboard Compared to Orion\" /></a>ManageWP Dashboard Compared to Orion\n<p>Users can now sort sites by tags and clients in addition to groups. Websites can be assigned to clients while tags can describe whether a site is in development or live. Each site can up to five tags and one client.</p>\n<p>Unlike the native dashboard, Orion uses Angular.js which allows users to run asynchronous calls. For example, you can run more than one command why performing other tasks.</p>\n<p>One distinct difference between both dashboards is the way backups are generated. ManageWP backups and Orion backups are <a href=\"https://managewp.com/managewp-orion-developer-diary-3-bulletproof-backup-solution\">completely different</a> from each other. However, you can use both at the same time.</p>\n<p>The company says Orion comes with essential features but additional features will be completed and added by February of 2016 which is also when Orion will become the default dashboard. WordPress Multisite is not supported as the company cites it as a major undertaking and doesn&#8217;t consider it a high priority.</p>\n<p>The new dashboard contains more features than what&#8217;s listed here. I encourage you to read the <a href=\"https://managewp.com/developer-diary-9-managewp-orion-is-out\">official announcement</a> and if you&#8217;re a customer, to explore Orion as it will soon be the default experience to managing sites. If you&#8217;re a ManageWP customer, let us know what you think of the new dashboard design.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 27 Oct 2015 18:09:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"WPTavern: How to Prepare and Take Advantage of Language Packs for Plugins Hosted on WordPress.org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48727\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:107:\"http://wptavern.com/how-to-prepare-and-take-advantage-of-language-packs-for-plugins-hosted-on-wordpress-org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:15607:\"<hr />\n<p>This is a guest post contributed by <a href=\"https://mpswp.wordpress.com/\">Matthew Sparrow</a> who is a young, self-taught developer with minimal coding knowledge that loves to use WordPress. He mostly uses WordPress for personal projects although he has completed a couple of projects for others. In addition to <a href=\"https://profiles.wordpress.org/kidsguide/\">maintaining a few plugins</a>, he&#8217;s an active translations contributor.</p>\n<hr />\n<p>Automatic translations for plugins have been a long time coming. WordPress itself already auto-downloads and auto-updates core translations, so it is a natural progression that plugins and themes will receive the same treatment.</p>\n<p>For those who have been following auto plugin translations, it has <a href=\"http://ottopress.com/2013/language-packs-101-prepwork/\">been in the works for years</a>. It came as a welcome surprise in September when it was announced that plugins will <a href=\"https://make.wordpress.org/plugins/2015/09/01/plugin-translations-on-wordpress-org/\">finally be able to have language packs</a>.</p>\n<p>If you have a plugin in the WordPress.org directory, then this is important, welcome, and exciting news. However, as great as an initiative as language packs are for plugins, it <em>seems</em> simpler than it actually is.</p>\n<p>If you are a plugin developer, you have to go through a few steps in order to get this to work for your plugins. So let’s get started.</p>\n<h2 class=\"font-headlines\">Should You Be Excited About Plugin Language Packs?</h2>\n<p>As a plugin author, I&#8217;m really excited about the new translation system, and so should you. The <a href=\"https://make.wordpress.org/polyglots/\">Polyglots team</a> is making it so that you no longer have to include all of your <code>.mo</code> and <code>.po</code> files directly in your plugin. Instead, they will be hosted on WordPress.org.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/10/screenshot-1.png\"><img class=\"aligncenter size-full wp-image-48731\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/10/screenshot-1.png?resize=582%2C575\" alt=\"screenshot-1\" /></a>The ideal scenario is when a user selects their language (either through a new WordPress install or through <code>Settings &gt; General</code>), the language pack for your plugin will be automatically installed and kept updated.</p>\n<p>This new system accomplishes a few things:</p>\n<ul>\n<li>Plugin files are smaller. There&#8217;s no need to include translation files with your plugin.</li>\n<li>Plugin authors no longer need to manage translations/translators.</li>\n<li>End users are automatically able to see a plugin in their own language assuming a translation has already been created for their locale.</li>\n</ul>\n<h2 class=\"font-headlines\">How to Prepare for Plugin Language Packs</h2>\n<p>Before we jump into translating plugins, you first need to prepare your plugin for it to work with the new translation setup.</p>\n<p>In order for you to get your plugin prepared to be moved over to the new system, you need to change your text domain to exactly match your WordPress plugin slug. An important reminder is that even if you have changed your plugin&#8217;s name (as <a href=\"https://wordpress.org/plugins/wordpress-seo/\">Yoast SEO</a> recently did), the slug does not change. For a more in-depth discussion and tutorial, please follow Otto&#8217;s great post on <a href=\"http://ottopress.com/2013/language-packs-101-prepwork/\">language pack prepwork</a>.</p>\n<p>You are still welcome to include translation files in your plugin, even with language packs enabled. Translation files in your plugin take priority, and if those aren&#8217;t present, that&#8217;s where language packs come in.</p>\n<p>When you are preparing your plugin for language packs, it is important to note that you should avoid removing translation files from your plugin. If you do so, and your plugin is selected for language packs, your existing translations will not be automatically moved over to the new system.</p>\n<p>Do your best to keep your translation files with your plugin until the Polyglots team has informed you that your plugin is ready for language packs.</p>\n<h2 class=\"font-headlines\">Wait to Receive the Official Notice</h2>\n<p>The Polyglot team is preparing the plugins in stages to avoid any major hiccups. Assuming your WordPress.org email is up-to-date, you will receive an email when your plugin is ready.</p>\n<p>You may be wondering how long it takes before the team reaches your plugin. There are 40,000+ plugins on WordPress.org, so it is not a quick process. WordPress is preparing plugins in batches according to the amount of active installs each plugin has.</p>\n<p>If your plugin has over 30,000+ active installs, then chances are you are on the new system, although I&#8217;ve seen plugins with 10,000+ active installs also be approved.</p>\n<p>Unfortunately, there is no way to make the process quicker. Please practice patience and eventually your turn will come.</p>\n<h2 class=\"font-headlines\">You’ve Received the E-Mail That Your Plugin Is Ready</h2>\n<p>So you finally receive the email saying that your plugin is going to be uploaded with language pack support. Awesome! This is what the email that I received looks like. Note that I&#8217;m using one of my approved plugins as an example.</p>\n<blockquote><p>Howdy!<br />\n​<br />\nWe&#8217;re emailing you because you&#8217;re an author for the following plugin on WordPress.org:<br />\n​<br />\n* Easy Updates Manager : https://wordpress.org/plugins/stops-core-theme-and-plugin-updates/<br />\n​<br />\nNext week, we intend to import the plugin listed above into the translate.wordpress.org translation system. Language packs will also be enabled for your plugin, for any locales that are fully translated (at 100%).<br />\n​<br />\nAs part of this process, all of the strings in your plugin will be imported into translate.wordpress.org. Additionally, any language files that you ship with your plugin (&#8216;mo&#8217; files) will be imported and synced with their respective locales within translate.wordpress.org.<br />\n​<br />\nNo strings in your plugin? Plugin translations include the ability to translate the readme and display these translations in the localized WordPress.org plugin directories.</p>\n<p>If you have prepared your plugin already then this notice is of no real importance. If you have not yet prepared your plugin and you have received the notice then you need to prepare your plugin ASAP. If you don’t prepare your plugin then… well… I don’t really know, but it won’t be good. So go and prepare your plugin if you have not yet done so.<br />\n&#8230;</p></blockquote>\n<h2 class=\"font-headlines\">Your Plugin Is Semi-Ready for Language Packs. Now What?</h2>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/10/screenshot-22.png\"><img class=\"alignright wp-image-48741 size-full\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/10/screenshot-22.png?resize=291%2C321\" alt=\"screenshot-22\" /></a>A week or so after you receive the notice, your plugin and its translations are moved to <a href=\"https://translate.wordpress.org\">translate.wordpress.org</a>. You will likely not receive a notice when your plugin is moved.</p>\n<p>To find out if it&#8217;s been uploaded, visit your plugin&#8217;s WordPress.org page where you should see a translations section in the right sidebar. Click the <strong>Translate Plugin Name </strong>button<strong>.</strong> If you are brought to a page that looks like the one below then your plugin is uploaded and is ready to be translated.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/10/screenshot-3.png\"><img class=\"aligncenter size-full wp-image-48734\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/10/screenshot-3.png?resize=954%2C611\" alt=\"screenshot-3\" /></a>If you see a page that looks different from this (i.e., a Not Found error), your plugin is not yet ready.</p>\n<p>Assuming you&#8217;ve received the e-mail, your plugin is ready, and you&#8217;ve waited a reasonable amount of time, you should be good to go as far as preparing your plugin.</p>\n<p>If it has been over two weeks and your plugin has not yet been uploaded, you should contact the Polyglot team <a href=\"https://make.wordpress.org/polyglots/\">on their blog</a>, or in the <a href=\"https://make.wordpress.org/chat/\">#polyglots channel on WordPress Slack</a>. Please exercise extreme patience as the process can take a week or sometimes even two.</p>\n<h2 class=\"font-headlines\">Removing Your Translation Files From Your Plugin</h2>\n<p>Now that your plugin is uploaded to the system, you can safely remove the translation files from your plugin. If you don’t have any <code>.mo</code> and <code>.po</code> files in your plugin, then you can skip this step.</p>\n<p>One thing to note: You may not want to remove your translation files if your plugin does not have any translations on <a href=\"https://translate.wordpress.org/\">translate.wordpress.org</a> or translations are not 100% complete.</p>\n<h2 class=\"font-headlines\">Making Your Plugin Translatable</h2>\n<p>With all of that stuff out-of-the-way, it’s time to focus on translating your plugin. This is where it can get confusing but try to stick with me.</p>\n<p>By default, you cannot submit translations for your plugin in any language. Because of this, you need to ask the Polyglots team to add you as a translator for your plugin. You can do so by heading over to the <a href=\"https://make.wordpress.org/polyglots/\">Polyglots blog</a> and ask them. To make it easier they came up with a template of <a href=\"https://make.wordpress.org/polyglots/handbook/rosetta/theme-plugin-directories/#sample-post\">what to say</a>.</p>\n<blockquote><p>Hello Polyglots!</p>\n<p>I am the plugin author for [plugin-name and link to plugin directory]. We have a number of great translation editors that we’d like to be able to approve translation for our plugin(s). Please add the following WordPress.org users as translation editors for their respective locales:<br />\no #ar – @username<br />\no #bn – @username, @username<br />\no #da – @username<br />\no #de-ch – @username<br />\netc…</p>\n<p>If you have any questions, just comment here. Thank you!</p></blockquote>\n<p>Ideally, the above will include requests for multiple plugins, but as plugins are being rolled out slowly, it&#8217;s acceptable at the moment to include one request per plugin.</p>\n<p>Make sure that you use WordPress.org usernames and that the user is still active. If you are wondering what languages there are, you can visit <a href=\"https://translate.wordpress.org/\">https://translate.wordpress.org/</a> and scroll through the different languages that WordPress supports.</p>\n<p>Please only ask to be added as a translator for the languages you know. You will not be approved if you are not a native speaker for a language.</p>\n<p>At this point, again, patience is needed. The Polyglot team will receive your request and will work through it. If your post doesn&#8217;t show up right away, it&#8217;s because first-time posters are moderated.</p>\n<p>In a week or two, the translators you requested should be added to your plugin. If there are any issues, a Polyglot member will comment on your request with any difficulties encountered or notify you that they have approved your request.</p>\n<p>You&#8217;ll know when you are added when you see new badges appear on your WordPress.org profile page. One is a translation editor badge and the other is a translation contributor badge.</p>\n<h2><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/10/screenshot-4.png\"><img class=\"aligncenter size-full wp-image-48735\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/10/screenshot-4.png?resize=601%2C322\" alt=\"screenshot-4\" /></a>How Do I Translate?</h2>\n<p>First, visit <a href=\"https://translate.wordpress.org/\">https://translate.wordpress.org/</a>, select your language, then click the plugins tab. Search for your plugin and then click the translate project button. You&#8217;ll be brought to a page that looks like the one below. This page is where you can translate your plugin. In this case, my plugin is already translated in the language that I selected.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/10/screenshot-5.png\"><img class=\"aligncenter size-full wp-image-48736\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/10/screenshot-5.png?resize=957%2C587\" alt=\"screenshot-5\" /></a>On this table, there are four separate things to translate. Trunk, the stable release (version), and the <code>readme.txt</code> variations. In order for language packs to work, <em>you need to translate all four versions</em>.</p>\n<p>To translate, click on one of the sub-projects. This takes you to the translation page. Here, you can see all of the different strings that need to be translated in your plugin. You can edit a string by clicking the details button, translating it in the text editor, and then clicking the <strong>add translations</strong> button.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/10/screenshot-6.png\"><img class=\"aligncenter size-full wp-image-48737\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/10/screenshot-6.png?resize=947%2C561\" alt=\"screenshot-6\" /></a>Even if you&#8217;re not added as an editor for a language, you can still translate a plugin. The only difference is instead of adding the translations directly, you can only request that it be changed. Someone from the Polyglots team will need review and approve your translation suggestions.</p>\n<h2 class=\"font-headlines\">Once Your Translations Are Ready</h2>\n<p>Once you&#8217;ve finished translating a language completely, it will be available for people to use. However, it doesn’t become available immediately. It can take one to three days for a translation to be available once you finish it. Again, exercise patience.</p>\n<p>You&#8217;ll know when the translation is available when you see it in the translation section on your WordPress.org plugin&#8217;s page. For example, you can see what it looks like in the picture below.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/10/screenshot-7.png\"><img class=\"aligncenter size-full wp-image-48744\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/10/screenshot-7.png?resize=447%2C377\" alt=\"screenshot-7\" /></a>Also, you&#8217;ll know it&#8217;s working if you go into a website (preferably not a live website), download your plugin, and select the language that you want to test in <strong>Settings &gt; General</strong>.</p>\n<h2 class=\"font-headlines\">Plugin Language Packs Are Here to Stay</h2>\n<p>Getting language packs to work properly in WordPress plugins is not exactly a straightforward process, which is precisely why plugins are being rolled out slowly.</p>\n<p>Please remember that everyone is a volunteer, from the Polyglots team, to translators, and to the plugin authors. Please give props where appropriate as everyone is working hard to make plugin language packs the norm.</p>\n<p>If you are having any trouble, the Polyglots team also has a <a href=\"https://make.wordpress.org/polyglots/handbook/\">handbook</a> available which provides some good information on how this new system works.</p>\n<p>I&#8217;ll also do my best to answer any questions in the comment section. If you have additional insight, please weigh in as well.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 27 Oct 2015 02:52:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: Test New WordPress Features Without Installing Anything via TryWPBeta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48713\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"http://wptavern.com/test-new-wordpress-features-without-installing-anything-via-trywpbeta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3568:\"<p>Over the weekend at <a href=\"https://portland.wordcamp.org/2015/\">WordCamp Portland, Oregon</a>, Drew Jaynes, a WordPress core developer who also led the 4.2 development cycle presented on the topic of beta testing WordPress.</p>\n<p>In the presentation, Jaynes highlights the pros and cons of using the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Testing plugin</a> on a testing site and a production site. However, he also cites a third way to test WordPress via <a href=\"http://wcpdx.trywpbeta.com/\">TryWPBeta.com</a>.</p>\n<p> \n<div> <strong> <a href=\"https://www.slideshare.net/DrewAPicture/trying-out-tomorrows-wordpress-today\" title=\"Trying Out Tomorrow’s WordPress Today\" target=\"_blank\">Trying Out Tomorrow’s WordPress Today</a> </strong> from <strong><a href=\"http://www.slideshare.net/DrewAPicture\" target=\"_blank\">DrewAPicture</a></strong> </div>\n<p>TryWPBeta is a locked down, vanilla install of WordPress trunk using Multisite. To login to the site, use the following credentials.</p>\n<ul>\n<li><strong>Username</strong>: wcpdx</li>\n<li><strong>Password</strong>: wcpdx15</li>\n</ul>\n<p>I asked Jaynes what inspired him to create the site, &#8220;The inspiration for TryWPBeta is to actually have a place for core contributors to test patches on mobile devices, because setting up a tunnel to a local development setup is difficult and a high barrier for a lot of people.&#8221;</p>\n<p>The idea is to make it possible to spin up a site using trunk (Bleeding edge version of WordPress), apply a specific patch and then freeze it in time so that we can point people there to test on mobile devices,&#8221; Jaynes told the Tavern.</p>\n<p>While you can&#8217;t install themes and plugins yet, the site gives users an opportunity to test new features without worrying about breaking the site. Thanks to TryWPBeta, I was able to test the new <a href=\"https://core.trac.wordpress.org/changeset/34903\">Post oEmbed feature</a> in 4.4.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/10/TestingPostoEmbeds.png\"><img class=\"size-full wp-image-48714\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/10/TestingPostoEmbeds.png?resize=1025%2C458\" alt=\"Testing oEmbeds of Posts\" /></a>Testing oEmbeds of Posts\n<p>Jaynes started the project at 10up&#8217;s company summit. So far, Scott Reilly, John Blackbourn, Zach Brown, Morgan Estes, and Chris Weigman have contributed to the project. The site is hosted on a DigitalOcean droplet and updates hourly. He stresses that the site is a work in progress and not quite ready for prime time, &#8220;There’s a couple features I’d like to add to make it more robust first,&#8221; Jaynes said.</p>\n<p>Unlike <a href=\"https://demo.joomla.org/\">Joomla</a>, WordPress doesn&#8217;t have a dedicated demo site for users to test drive the software. While I like the idea behind TryWPBeta, there are a few things I&#8217;d like to see added to make it more useful. For instance, a list of items to test that users can check off. Also, an easy way to provide feedback on the listed items that is sent to a place where core developers will read it.</p>\n<p>Ultimately, I&#8217;d like to see the WordPress Beta Testing plugin extended to have the features I mentioned above. Between the communication challenges and setting up the environment, the beta testing process in WordPress is not as easy and streamlined as it could be. What ideas do you have that would help increase the testing audience and make the process easier?</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 27 Oct 2015 00:37:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"WPTavern: VersionPress Raises $400K in Seed Funding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48709\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"http://wptavern.com/versionpress-raises-400k-in-seed-funding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2780:\"<p><a href=\"http://versionpress.net/\">VersionPress</a>, a version control plugin for WordPress, has <a href=\"http://blog.versionpress.net/2015/10/seed-funding/\">raised $400K in seed funding</a> from five investors, led by <a href=\"http://www.credoventures.com/\">Credo Ventures</a> based in Prague. In July of 2014, VersionPress conducted a <a href=\"http://wptavern.com/versionpress-misses-crowdfunding-goal-by-14-5k\">crowdfunding campaign</a> to raise $30K. However, the team raised only <strong>45% of the $30,000</strong> funding goal.</p>\n<p>The team pressed on and released the first version back in January. Since then, the team has relied on funding from the <a href=\"http://versionpress.net/\">Early Access Program</a>. Borek Bernard, the lead developer of VersionPress, says the influx of cash will help fuel rapid development:</p>\n<blockquote><p>First and foremost, it means that we will be able to develop VersionPress at a more rapid pace. What we currently have in the <a href=\"http://blog.versionpress.net/2015/10/versionpress-2-0-released/\">recently released v2.0</a> is a great start but the vision and the technical challenge are just so large that this new fuel will is more than welcome. We have many cool features planned and this will allow us to deliver them in a timely manner.</p></blockquote>\n<p>The funding comes on the heels of <a href=\"http://blog.versionpress.net/2015/10/versionpress-2-0-released/\">VersionPress 2.0</a> which includes, database synchronization functionality and an updated user interface that is completely JavaScript based, along with a number of other features. In addition to funding, Bernard says talking to investors gives him a fresh perspective on the project:</p>\n<blockquote><p>One big benefit of talking to investors is that it provides a fresh perspective on the problems one is trying to solve, how to solve them, for whom, etc. Speaking to them made us realize a couple of important things which will greatly benefit our users down the road.</p></blockquote>\n<p>VersionPress joins a growing list of WordPress products and services that have raised venture capital. In 2014, <a title=\"http://wordpress.org/plugins/coschedule-by-todaymade/\" href=\"http://wordpress.org/plugins/coschedule-by-todaymade/\">CoSchedule</a>, the editorial workflow and activity scheduling plugin, <a title=\"http://coschedule.com/blog/coschedule-series-a-funding/\" href=\"http://coschedule.com/blog/coschedule-series-a-funding/\">secured $500K</a> in a Series A round of funding. Prior to being acquired by Automattic, <a href=\"http://wptavern.com/wordpress-service-provider-bruteprotect-secures-funding-forms-parka-llc\">BruteProtect secured a round of funding</a> from a private angel investor in California.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 26 Oct 2015 20:00:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Matt: .Ly Domains\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=45516\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"http://ma.tt/2015/10/ly-domains/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:154:\"<p>Priceonomics on <a href=\"http://priceonomics.com/the-rise-and-fall-of-ly/\">The Rise and Fall of .Ly</a>. Some of my favorite domains I own are .ly.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 26 Oct 2015 19:04:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"WPTavern: Nikhil Vimal Acquires Front End Registration and Login Forms Plugin From Pippin Williamson\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48695\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:110:\"http://wptavern.com/nikhil-vimal-acquires-front-end-registration-and-login-forms-plugin-from-pippin-williamson\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2679:\"<p>Nikhil Vimal, who runs <a href=\"https://techvoltz.com/\">Techvoltz.com</a>, a WordPress development agency, <a href=\"https://techvoltz.com/blog/2015/10/23/new-plugin-front-end-registration-and-login-forms-plugin/\">is the new owner</a> of the <a href=\"https://techvoltz.com/downloads/front-end-registration-login-forms-plugin/\">Front End Registration and Login Forms Plugin</a> created by Pippin Williamson. Earlier this month, Williamson put the plugin up for sale and noted that it needed some development work.</p>\n<blockquote class=\"twitter-tweet\" width=\"550\"><p lang=\"en\" dir=\"ltr\">I would like to sell my Frontend Registration and Login Forms plugin. <a href=\"https://t.co/HLGc8OVxq4\">https://t.co/HLGc8OVxq4</a> &#8211; It needs some work. Interested? Ping me</p>\n<p>&mdash; Pippinsplugins (@pippinsplugins) <a href=\"https://twitter.com/pippinsplugins/status/651489362052431872\">October 6, 2015</a></p></blockquote>\n<p></p>\n<p>The plugin was created in December of 2011, when Williamson <a href=\"https://pippinsplugins.com/creating-custom-front-end-registration-and-login-forms/\">published a tutorial</a> that explains how to create custom front end registration and login forms for WordPress. Although Vimal is participating in the commercial plugin space by selling a <a href=\"https://ninjaforms.com/extensions/slack/\">Slack add-on for Ninja Forms</a>, this acquisition marks the first plugin sold directly from his site.</p>\n<p>With the acquisition, <a href=\"https://pippinsplugins.com/nikhil-vimal-adopts-front-end-registration-and-login-forms-plugin/\">Williamson notes</a> that existing customers will no longer be able to renew license keys on <a href=\"https://pippinsplugins.com\">Pippinsplugins.com</a>. A complete customer list was given to Vimal and Williamson is no long providing support.</p>\n<p>When the opportunity presented itself to adopt a plugin created by Williamson, Vimal jumped on it, &#8220;Shortly after I saw his tweet, I quickly contacted Pippin. His work is something I’ve always looked up to. His work on plugins has inspired me to pursue the plugin/product market,&#8221; Vimal said.</p>\n<p>Licenses start at $10 for single sites, $20 for two to five sites, and $35 for an unlimited number of sites. Vimal says that he is working on a new version with changes in design, functionality, and more. The plugin will also receive its own dedicated site with a change in branding.</p>\n<p>It will be interesting to see what changes Vimal has in store for the plugin. Until then, existing customers from Pippinsplugins.com should watch their inbox for details on renewing their subscription to TechVoltz.com.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 23 Oct 2015 20:02:38 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"WPTavern: WordPress 4.4 Beta 1 Released\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48687\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"http://wptavern.com/wordpress-4-4-beta-1-released\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4051:\"<p>After more than eight weeks in development, <a href=\"https://wordpress.org/news/2015/10/wordpress-4-4-beta-1/\">WordPress 4.4. beta 1 is available</a> for testing. With over <a href=\"https://github.com/WordPress/WordPress/compare/4.3-branch...master\">1,600 commits</a> since WordPress 4.3&#8217;s release, it&#8217;s important that 4.4 be tested by as many people as possible.</p>\n<p>Commits are bug fixes, additional functions or filters, new features, corrected typos, and anything inbetween. As a rule of thumb, think of commits as an incremental improvement to WordPress core.</p>\n<p>There are three new distinct user facing features in WordPress 4.4.</p>\n<ul>\n<li><strong>Twenty Sixteen</strong> &#8211; Twenty Sixteen is a <a href=\"http://wptavern.com/first-look-at-the-twenty-sixteen-default-wordpress-theme\">new default theme</a> with a simple layout and color scheme designed by <a href=\"https://profiles.wordpress.org/iamtakashi\">Takashi Irie,</a> who also designed the <a href=\"http://takashiirie.com/2013/12/13/twenty-fourteen-wordpress-3-8-parker/\">Twenty Fourteen</a> and <a href=\"http://takashiirie.com/2015/03/19/twenty-fifteen-the-wordpress-default-theme-for-2015/\">Twenty Fifteen</a> default themes.</li>\n<li><strong>Responsive Images</strong> &#8211; WordPress will automatically deliver a <a href=\"https://make.wordpress.org/core/2015/09/30/responsive-images-merge-proposal/\">more appropriate image</a> to users depending on a variety of conditions like screen size, view port size, and screen resolution.</li>\n<li><strong>oEmbed Posts</strong> &#8211; In addition to YouTube, WordCamp.TV and other whitelisted providers, users will be able to easily embed content from almost any site that supports the <a href=\"http://oembed.com/\">oEmbed standard</a>, including <a href=\"https://make.wordpress.org/core/2015/09/30/feature-plugin-merge-proposal-oembed/\">WordPress sites</a>.</li>\n</ul>\n<p>Scott Taylor, who is leading the 4.4 development cycle, gives developers at least four reasons to be excited.</p>\n<ul>\n<li><strong>REST API (phase 1) </strong>— The underlying infrastructure of the WordPress REST API <a href=\"https://wordpress.org/plugins/rest-api/\">plugin</a> is <a href=\"https://make.wordpress.org/core/2015/09/21/wp-rest-api-merge-proposal/\">included in WordPress 4.4</a>. Plugin authors can take advantage of this by adding custom endpoints.</li>\n<li><strong>Term Metadata </strong>— Taxonomy term metadata <a href=\"https://make.wordpress.org/core/2015/09/04/taxonomy-term-metadata-proposal/\">is included</a> in WordPress 4.4. Developers who are using a plugin to implement term metadata should <a href=\"https://make.wordpress.org/core/2015/09/22/preparing-your-plugins-and-your-client-sites-for-termmeta/\">read this post</a> on how to prepare for the switch. Also, the underlying <a href=\"https://make.wordpress.org/core/2015/09/22/preparing-your-plugins-and-your-client-sites-for-termmeta/\">WP_Term class</a> improves caching when working with terms.</li>\n<li><strong>Improved <code>&lt;title&gt;</code> output</strong> — <code>wp_title()</code> is deprecated; WordPress will <a href=\"https://make.wordpress.org/core/2015/10/20/document-title-in-4-4/\">handle the rendering</a> of the document title automatically.</li>\n<li><strong>Comments </strong>— Comment queries are now split for performance. Also, the underlying <code>WP_Comment</code> class improves caching and introduces strong-typing. (<a href=\"https://core.trac.wordpress.org/ticket/8071\">#8071</a>, <a href=\"https://core.trac.wordpress.org/ticket/32619\">#32619</a>)</li>\n</ul>\n<p>Users are highly encouraged to test WordPress 4.4 and report bugs to the <a href=\"https://wordpress.org/support/forum/alphabeta\">Alpha/Beta section</a> of the support forums. Remember, the beta is software still in development and therefor not recommend for use on a production site. WordPress 4.4 <a href=\"https://make.wordpress.org/core/version-4-4-project-schedule/\">is scheduled</a> for release on December 8th.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 23 Oct 2015 18:57:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WPTavern: WPWeekly Episode 210 – Great Scott!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48680\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"http://wptavern.com/wpweekly-episode-210-great-scott\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2994:\"<p>In this time travel inspired episode of WordPress Weekly, <a href=\"http://marcuscouch.com/\">Marcus Couch</a> and I catch you up on the news of the week. I start the show by sharing my experience attending the first WordCamp Hampton Roads in Virginia Beach, VA. While in Virginia Beach, I visited and worked from the <a href=\"http://www.rocketgenius.com/\">Rocketgenius</a> office and observed how the team behind Gravity Forms works on a daily basis. In the show, I explain why I think the company&#8217;s setup is the best of both worlds for distributed workers.</p>\n<p>We discuss what the future of WordPress may be like 10 years from now and whether or not it&#8217;s time for the XML-RPC protocol to be removed from WordPress. We end the show with the plugin picks of the week.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"http://wptavern.com/anyssa-ferreira-awarded-the-kim-parsell-memorial-scholarship\">Anyssa Ferreira Awarded the Kim Parsell Memorial Scholarship</a><br />\n<a href=\"https://make.wordpress.org/core/2015/10/20/document-title-in-4-4/\">WP_Title is deprecated in WordPress 4.4</a><br />\n<a href=\"http://torquemag.io/what-will-wordpress-be-like-in-next-10-years/\">What Will WordPress Be Like In Next 10 Years?</a> Here’s an <a href=\"http://torquemag.io/what-will-wordpress-be-like-in-next-10-years/#comment-2299329174\">awesome comment</a> on the article.<br />\n<a href=\"http://wptavern.com/its-time-for-xml-rpc-in-wordpress-to-hit-the-road\">It’s Time for XML-RPC in WordPress to Hit the Road</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/woo-price-per-word/\">WooCommerce Price Per Word</a> allows customers to upload a document to the product page. The word-count of the document is used to calculate the price based on the price-per-word entered for the product.</p>\n<p><a href=\"https://wordpress.org/plugins/shortcode-tester/\">Shortcode Tester</a> is a post editor tool for WordPress developers that displays the HTML generated by WordPress shortcodes in a popup window. You can quickly view the generated HTML without having to view the entire post.</p>\n<p><a href=\"https://wordpress.org/plugins/beehive/\">Beehive cells</a> arranges the content on your front page into a series of hexagonal cells similar to a beehive.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, October 28th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #210:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 22 Oct 2015 09:06:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"WPTavern: WordPress 4.4 to Deprecate the wp_title Function\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48669\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"http://wptavern.com/wordpress-4-4-to-deprecate-the-wp_title-function\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1711:\"<p>A year after <a href=\"https://make.wordpress.org/core/2014/10/29/title-tags-in-4-1/\">WordPress 4.1 introduced</a> a new way to display titles in themes, WordPress 4.4 <a href=\"https://make.wordpress.org/core/2015/10/20/document-title-in-4-4/\">will deprecate</a> <code>wp_title()</code>. With <a href=\"https://core.trac.wordpress.org/changeset/35294\">the change</a>, plugin authors will be able to check for theme support and use a few new filters to manipulate the title. The new filters are as follows:</p>\n<ul>\n<li><code>\'pre_get_document_title\'</code> short-circuits <code>wp_get_document_title()</code> if it returns anything other than an empty value.</li>\n<li><code>\'document_title_separator\'</code> filters the separator between title parts.</li>\n<li><code>\'document_title_parts\'</code> filters the parts that make up the document title, passed in an associative array.</li>\n</ul>\n<p>Theme authors should no longer use <code>wp_title()</code> to generate document titles. If theme authors add <code>add_theme_support( ‘title-tag’ );</code> to the <code>after_setup_theme</code> callback, the title will be handled natively via an internal WordPress core function. If you use a theme that utilizes wp_title and have <a href=\"https://codex.wordpress.org/WP_DEBUG\">wp_debug enabled</a> in WordPress 4.4, you&#8217;ll see a deprecation notice.</p>\n<p>In general, users who upgrade to WordPress 4.4 won&#8217;t notice a difference. However, with nearly a <a href=\"https://make.wordpress.org/core/version-4-4-project-schedule/\">month to go</a> before WordPress 4.4 is released, theme developers are highly encouraged to check and update their themes accordingly.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 22 Oct 2015 07:52:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"WPTavern: Anyssa Ferreira Awarded the Kim Parsell Memorial Scholarship\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48662\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"http://wptavern.com/anyssa-ferreira-awarded-the-kim-parsell-memorial-scholarship\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2542:\"<p>Back in August, the WordPress Foundation <a href=\"http://wptavern.com/the-wordpress-foundation-begins-accepting-applications-for-the-kim-parsell-memorial-scholarship\">began accepting applications</a> for the <a href=\"http://wptavern.com/the-wordpress-foundation-creates-a-traveling-scholarship-in-memory-of-kim-parsell\">Kim Parsell Memorial Scholarship</a>. The scholarship not only serves as a memorial, but gives one woman in the WordPress community an opportunity to attend WordCamp US with financial assistance from the foundation.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/10/AnyssaFerreira.jpg\"><img class=\"wp-image-48664 size-full\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/10/AnyssaFerreira.jpg?resize=256%2C256\" alt=\"AnyssaFerreira\" /></a>Anyssa FerreiraThe WordCamp US website <a href=\"https://2015.us.wordcamp.org/2015/10/14/announcing-the-kim-parsell-memorial-scholarship-winner-anyssa-ferreira/\">announced</a> Anyssa Ferreira, a Brazilian designer, feminist, and WordPress community activist as the first recipient of the scholarship. Ferreira organized and spoke at WordCamp São Paulo in 2014 and designed the event&#8217;s website. She was the only woman to speak and volunteer at the event.</p>\n<p>In 2015, Ferreira spoke at WordCamp Belo Horizonte&nbsp;on women working with WordPress in the Brazilian community. According to the post, Ferreira continues to play an active role encouraging women to get involved with WordPress and the technology field in Brazil:</p>\n<blockquote><p>She has worked to debunk the myth that women have no interest in WordPress and web development. She has explored why women were not participating, speaking personally with many female programmers, designers and other WordPress professionals about this important topic. She regularly invites women to attend her local WordPress meetup, and works to ensure that they feel welcome and wanted when they do attend.</p></blockquote>\n<p>Not only does Ferreira fulfill the <a href=\"http://wptavern.com/the-wordpress-foundation-begins-accepting-applications-for-the-kim-parsell-memorial-scholarship\">scholarship&#8217;s requirements</a>, she&#8217;s the type of woman Kim Parsell would love to meet and talk to in person.</p>\n<p>Thanks again to Jen Mylo, the WordPress foundation, and Matt Mullenweg for not only creating the scholarship, but for providing an opportunity for people like Ferreira to experience the largest annual WordPress conference first-hand.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 21 Oct 2015 23:00:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"WPTavern: It’s Time for XML-RPC in WordPress to Hit the Road\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=48643\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"http://wptavern.com/its-time-for-xml-rpc-in-wordpress-to-hit-the-road\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:8672:\"<hr />\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/10/JesseNicklesAvatar.jpg\"><img class=\"alignright wp-image-48651 size-thumbnail\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/10/JesseNicklesAvatar.jpg?resize=150%2C150\" alt=\"Jesse Nickles Founder of Little Bizzy\" /></a>This post was contributed by <a href=\"https://www.linkedin.com/pub/jesse-nickles/61/807/435\" target=\"_blank\">Jesse Nickles</a>. He is the founder of <a href=\"https://www.littlebizzy.com\" target=\"_blank\">LittleBizzy</a>, a managed WordPress hosting company, and a part-time blogger at <a href=\"https://collegetimes.co/\" target=\"_blank\">CollegeTimes</a>, where he gets into trouble exploring controversial issues.</p>\n<hr />\n<p>Two weeks ago, I <a href=\"https://www.littlebizzy.com/blog/disable-xml-rpc\">announced</a> that all current and future domains hosted at <a href=\"https://www.littlebizzy.com\" target=\"_blank\">LittleBizzy</a> would have <a href=\"https://codex.wordpress.org/XML-RPC_Support\" target=\"_blank\">XML-RPC</a> permanently blocked due to the non-stop problems it was causing. In the announcement, we recommended that other WordPress users across the globe urgently consider blocking the technology on their own web servers as well.</p>\n<h2>XML-RPC in WordPress Has a Troubled Past</h2>\n<p>Days after the announcement<em>,</em> Daniel Cid, founder and CTO of Sucuri, and Mark Maunder, CEO of WordFence, <a href=\"https://blog.sucuri.net/2015/10/brute-force-amplification-attacks-against-wordpress-xmlrpc.html\" target=\"_blank\">confirmed</a> the <a href=\"https://www.wordfence.com/blog/2015/10/wordpress-xml-rpc-brute-force-attacks-amplification-multiple-logins/\" target=\"_blank\">reports</a> that a new type of Brute Force login attack was being carried out on a massive scale against WordPress sites around the world using XML-RPC. Apparently, hackers have wised up to the fact that <code>wp-login.php</code> is often well protected.</p>\n<p>Perhaps more shocking than this latest wave of attacks is that <em>they are nothing new,</em> as Sucuri previously <a href=\"https://blog.sucuri.net/2014/07/new-brute-force-attacks-exploiting-xmlrpc-in-wordpress.html\">reported a similar wave of attacks</a> in July 2014. Let&#8217;s also not forget the wide-scale use of XML-RPC to perform <a href=\"http://www.webopedia.com/TERM/D/DDoS_attack.html\">DDoS attacks</a> on WordPress websites <a href=\"https://www.incapsula.com/blog/wordpress-security-alert-pingback-ddos.html\">reported by Incapsula</a> in 2013. Combine these reports with <a href=\"https://www.google.com/search?hl=en&q=site%3Awordpress.org%2Fsupport%2F+xml-rpc+attack\">hundreds of posts</a> on the wordpress.org support forums and <a href=\"https://www.google.com/search?hl=en&q=site%3Astackoverflow.com+xml-rpc+attack\">Stack Overflow</a> and a picture is painted of years of unhindered attacks against millions of WordPress sites due to this single PHP file, yikes!</p>\n<blockquote><p>It is common sense to take a method and try it. If it fails, admit it frankly and try another. But above all, try something. ― Franklin D. Roosevelt</p></blockquote>\n<p>I didn&#8217;t expect to be the one to advocate that XML-RPC be removed from WordPress but that&#8217;s exactly what I&#8217;m doing: <strong>It&#8217;s time for WordPress XML-RPC to hit the road, for good.</strong></p>\n<h2>XML-RPC Was a Conscious Mistake</h2>\n<p>I understand that thousands of volunteer hours have been invested into XML-RPC support for the WordPress platform, as is the nature of open-source communities. I sincerely respect and thank said programmers and volunteers for creating a very cool way to remotely connect to a website built on WordPress. But sometimes, we need to be honest with ourselves and admit when something isn&#8217;t working; <em>This one of those times.</em></p>\n<p>If you&#8217;re wondering why I&#8217;m framing the XML-RPC mess as a conscious mistake, <strong>that&#8217;s because it was</strong>. Three years ago, Andrew Nacin, a WordPress core developer, <a href=\"https://core.trac.wordpress.org/ticket/21509\" target=\"_blank\">announced</a> in a trac ticket that, <em>&#8220;Security is no greater a concern than the rest of core. There is no longer a compelling reason to disable [XML-RPC] by default. It’s time we should remove the option entirely.&#8221;</em></p>\n<p>Three years later, millions of WordPress sites have been hacked, crashed, or attacked, due to XML-RPC. It’s undeniable that removing the option to disable it (and/or enabling it by default) was wrong.</p>\n<h2>Out of Touch With the Average User</h2>\n<p>When broken down, it&#8217;s a classic case of extremely talented and intelligent software developers being out of touch with the millions of <strong>average Joes</strong> that use WordPress and have no idea what XML-RPC is. When developers inevitably argue that there are several free security plugins available that can help combat XML-RPC attacks, they completely miss the point: <u>the majority of webmasters being attacked are the same ones who don&#8217;t even know what a security plugin is or how to use it</u>.</p>\n<p>Ironically, the one good <a href=\"https://wordpress.org/plugins/bruteprotect/\" target=\"_blank\">standalone plugin</a> that fought Brute Force login attempts was <a href=\"http://wptavern.com/automattic-acquires-parka-llc-the-creators-of-bruteprotect\" target=\"_blank\">foolishly</a> <a href=\"http://wptavern.com/jetpack-protect-blocks-brute-force-amplification-attacks\" target=\"_blank\">combined</a> into the controversial Jetpack plugin, which most serious webmasters would never consider installing.</p>\n<p>The premise, of course, for XML-RPC support in WordPress is a noble idea that sounds versatile: it allows, as previously mentioned, remote connections (logins, usually) to any given domain that is running a WordPress installation. In reality, however, this XML-RPC functionality is primarily used for three common reasons:</p>\n<ol>\n<li>Pingbacks/trackbacks (great for Viagra spam, <a href=\"http://wptavern.com/wptavern-was-trackbacked-to-death\" target=\"_blank\">DDoS attacks</a>, and not much else)</li>\n<li>Jetpack (an all-in-one solution to <a href=\"http://blog.arunas.co/project-measure-jetpack/\" target=\"_blank\">slowing down</a> and/or bloating your WordPress site with third-party scripts)</li>\n<li>WP mobile apps (I&#8217;m not sure who blogs from their smart phone, but the <a href=\"https://itunes.apple.com/us/app/yo./id834335592\" target=\"_blank\">YO app</a> is literally rated higher than <a href=\"https://itunes.apple.com/en/app/wordpress/id335703880\" target=\"_blank\">WordPress</a> on the iTunes store, and the user reviews of the <a href=\"https://play.google.com/store/apps/details?id=org.wordpress.android\" target=\"_blank\">Android</a> version repeatedly point to XML-RPC login issues)</li>\n</ol>\n<p>Do recall that the WordPress backend is now responsive, which means you can login to your blog from practically any mobile device; this wasn’t the case when the native WordPress mobile apps were first launched. And arguably, the vast majority of WordPress sites have absolutely no use for pingbacks, trackbacks, or XML-RPC in general.</p>\n<h2>XML-RPC Needs to Be Disabled or Removed From WordPress</h2>\n<p><u>The logical conclusion should be immediately clear:</u> XML-RPC needs to die a quick death in the WordPress community, or at least be shifted into an optional (non-default) plugin or otherwise, in order to bring an immediate and measurable improvement to the security and stability of not only WordPress sites, but the internet overall.</p>\n<p>Perhaps Jeff Chandler <a href=\"http://wptavern.com/how-to-prevent-wordpress-from-participating-in-pingback-denial-of-service-attacks\" target=\"_blank\">said it best</a>:</p>\n<blockquote><p>WP Tavern is no stranger to denial of service attacks due to pingbacks and trackbacks. In 2010, I explained how WP Tavern was trackbacked to death. Shortly after the website came back online, I disabled both as I feared they might end up taking the site down again. A few years have gone by and I’ve re-enabled pingbacks and trackbacks with no ill effects. However, I wonder if it’s time to kill them once and for all, not just on WP Tavern but in WordPress in general.</p></blockquote>\n<p>Sometimes, we as developers and others with a technical mindset get caught up in solving the challenge of the day, when what is really needed is to step back and take a more philosophical look at the bigger picture. Is this thing worth our time, or is it causing more problems than solutions? When it comes to XML-RPC in WordPress, the conclusion is obvious.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 21 Oct 2015 21:33:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"Post Status: Playing with type\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=14750\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://poststatus.com/playing-with-type/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:8443:\"<p>I am far from a typography expert, but I do love playing with type. I delight in a great reading experience, and I strongly believe typography is the key to creating a great reading experience.</p>\n<p>In my own journeys searching for and choosing typefaces for my projects, I&#8217;ve discovered some great tools, and also some pitfalls of using different delivery services.</p>\n<p>I have <a href=\"http://typography.com\">Typography.com</a> and <a href=\"http://typekit.com\">Typekit</a> accounts, and of course using <a href=\"http://google.com/fonts\">Google Fonts</a> is very simple. Many folks also use <a href=\"http://www.myfonts.com/\">Myfonts</a>, generate their own on <a href=\"http://www.fontsquirrel.com/\">Fontsquirrel</a>, self-host direct from foundries, or use a variety of other methods.</p>\n<p>When you use a font delivery service, where the font is hosted elsewhere, and you simply connect (like Typekit or Typography.com), one of the things you deal with is the authentication of your site with the service that can often cause sad delays in pageload times. Zach Tollman did a great post discussing how <a href=\"https://www.tollmanz.com/typography-coms-cssom-blocking-font-loader/\">Typography.com in particular is not good at handling this authentication</a>, from a performance perspective.</p>\n<p>Given that I host Post Status fonts on Typography.com &#8212; I use Gotham Round, Gotham Condensed, and Sentinel here, and none of them are available anywhere else &#8212; the hit on performance perturbs me. However, I love these fonts and hate to replace them. However, I&#8217;ve lately been doing some research so I can at least test font stacks from Typekit and Google to see how big of an impact it could have.</p>\n<h3>Finding Typefaces</h3>\n<p>Finding quality typefaces is a challenge. There are <em>so many</em> out there, and the differences in quality can be vast. Part of what I love about Typography.com is that the quality of the display and cross-browser rendering is outstanding. Typekit serves typefaces from a variety of foundries, but they too have built great tools over the years to try and ensure quality rendering. Google is more of a mixed bag, though open source typefaces are getting more attention to detail in recent years than ever before.</p>\n<p>By far, my favorite tool for browsing and finding typefaces is <a href=\"https://www.typewolf.com\">Typewolf</a>. Typewolf has PDF guides (free with your email), trending typefaces, sites of the day, and high quality recommendations on when and where to use a particular typeface. A sample resource that&#8217;s outstanding is their list of the <a href=\"https://www.typewolf.com/open-source-web-fonts\">top 30 open source Google fonts</a>. They have many others like that. It&#8217;s definitely a must-visit site when you are considering changing up your site typography.</p>\n<p>You can also browse delivery services directly. Typekit&#8217;s <a href=\"https://typekit.com/lists\">lists</a> are pretty good for narrowing typefaces by their intended purpose. <a href=\"http://justmytype.co/\">Justmytype</a> is another great resource that shows recommended pairings for fonts from Typekit and Typography.com. And of course Google has filters in their directory to help narrow it down, but it&#8217;s still a bit of the wild west, so I usually rely on Googling good pairings for Google.</p>\n<h3>Tinkering with typefaces with real content</h3>\n<p>Once you find some Typefaces you like, then it&#8217;s fun to put them into practice. <a href=\"http://typecast.com/\">Typecast</a> is excellent. You can find fonts from many foundries with a free account, and do all sorts of manipulations to see the typefaces in action, using a variety of font combinations, before you move to your actual site.</p>\n<p><img class=\"aligncenter size-large wp-image-14749\" src=\"https://cdn.poststatus.com/wp-content/uploads/2015/10/typecast-view-752x462.png\" alt=\"typecast-view\" width=\"752\" height=\"462\" /></p>\n<p>Beware, it&#8217;s easy to spend hours in this tool. I love that you can edit the CSS directly, and there are also tools within Typecast to insert particular types of content, so you can have a working prototype pretty quickly.</p>\n<h3>Performance implications</h3>\n<p>Loading fonts is a huge performance issue sometimes. Too many fonts, content blocking loading, time-outs from third party delivery services, and other gotchas can severely impact a site&#8217;s load times.</p>\n<p>Anytime you are looking at new typefaces to use, consider where you can serve them from, whether you can self host them, how the delivery authenticates, and potentially more &#8212; before you get your heart set.</p>\n<p>Some good rules of thumb are this:</p>\n<ul>\n<li>Google is by far the fastest, but you just don&#8217;t have access to some of the greatest font foundries this way, because all Google fonts are free.</li>\n<li>Self hosting is probably similar to or faster than serving them from Google. Most Google fonts are locally cached on lots of folks computers. Self hosting may be better for a more rare font, but for common fonts, Google may actually be faster.</li>\n<li>System fonts are always the fastest, but you might not be able to deliver your preferred typeface if the system the reader is using doesn&#8217;t support the typeface. If using system typefaces, creating thorough font stacks is a necessity. Sometimes, especially for sans-serifs, I&#8217;m tempted to just declare sans-serif, so that the system serves its favorite font &#8212; as Android, Mac, iOS, Windows, et al each have their own defaults. For serifs, I&#8217;d say just use Georgia if using system fonts only <img src=\"https://cdn.poststatus.com/wp-includes/images/smilies/simple-smile.png\" alt=\":)\" class=\"wp-smiley\" /></li>\n<li>Typekit and Myfonts and other delivery services are usually similar in quality, but it&#8217;s one of the slowest options for delivery. Be sure to only use the weights and versions you need, and considering limiting character sets if you can get away with it.</li>\n<li>Have a performance budget for your type. Sometimes you have to make hard choices. Does your body font really need to be a non-system font? What if you just used a single display font to add the character you seek? Can you get away without italics for a certain typeface you&#8217;re using? What about bold? If you use the regular/bold/italic/bold-italic for every typeface, that adds up quickly. Use the bare minimum and add whenever you need to only.</li>\n</ul>\n<h3>Don&#8217;t get too fancy, and consider your tone</h3>\n<p>My biggest mistakes over the years playing with type have been getting too fancy, especially with body copy. Simple is good with type. Especially when choosing body copy, be sure to learn about the typeface you like &#8212; and don&#8217;t just trust your own eye early on &#8212; to see if it&#8217;s an appropriate workhorse typeface.</p>\n<p>With display type, you have more leeway, but consider the mood that the typeface sets. Slabs, serifs, gothic, humanist, and other styles of type each tend to have their own tone that they set. For instance, when you read the New York Times, Georgia is a serious workhorse font, and the custom display font also sets a sober tone. Compared to Vox, for example, which uses a more casual sans-serif body copy and quite decorative display typeface. In both scenarios, readability is very good, but they set a different tone.</p>\n<h3>Learning typography takes time</h3>\n<p>Learning and understanding good typography practices takes time. Many factors are at play to make a typeface look great, and even the greatest typefaces can get screwed up when not used well.</p>\n<p>Learning best practices for things like line length, line height, pairing, and much much more can probably get you farther than what typeface you choose. And different typefaces obviously do better in different settings. The key is to take it slow, learn what you like when you are reading other websites, and see what they are doing that you are not. Also, ask your friends about your choices and get feedback; sometimes just a minor change can make a big difference, and suddenly your design clicks.</p>\n<p>We can easily be blind to our own typography mistakes. If you can limit mistakes and learn the essentials of choosing typefaces and using them well, your websites will look much, much better and your readers will be thankful, even if they never say it.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 16 Oct 2015 17:23:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"Post Status: Work life balance — Draft podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=14740\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://poststatus.com/work-life-balance-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1393:\"<p>Welcome to the Post Status Draft podcast, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a> and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Brian and his co-host, <a href=\"https://twitter.com/joe_hoyle\">Joe Hoyle</a>, a co-founder and the CTO of <a href=\"https://hmn.md/\">Human Made</a>, discuss some of today’s hottest, current WordPress news.</p>\n<p>In this episode of Draft, Joe and Brian discuss work life balance. We discuss working long hours, managing and preventing burnout, moonlighting and its challenges, side projects, embracing hobbies, and creating exercise routines.</p>\n<a href=\"https://audio.simplecast.fm/18534.mp3\">https://audio.simplecast.fm/18534.mp3</a>\n<p><a href=\"http://audio.simplecast.fm/18534.mp3\">Direct Download</a></p>\n<p>Links</p>\n<ul>\n<li><a href=\"http://www.carriedils.com/overcoming-burnout/\">Overcoming burnout</a></li>\n<li><a href=\"http://dangerousminds.net/comments/photographer_removes_smartphones_from_images_to_show_how_obsessed_we_are_wi\">People without phones in phone poses</a></li>\n<li><a href=\"http://waitbutwhy.com/2013/10/why-procrastinators-procrastinate.html\">Epic procrastination series</a></li>\n<li><a href=\"http://andyadams.org/why-you-shouldnt-moonlight/\">Don&#8217;t moonlight long-term</a></li>\n</ul>\n<p>&nbsp;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 16 Oct 2015 13:24:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Katie Richards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";a:10:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Fri, 20 Nov 2015 09:27:39 GMT\";s:12:\"content-type\";s:8:\"text/xml\";s:14:\"content-length\";s:6:\"191962\";s:10:\"connection\";s:5:\"close\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:13:\"last-modified\";s:29:\"Fri, 20 Nov 2015 09:15:16 GMT\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:4:\"x-nc\";s:11:\"HIT lax 250\";s:13:\"accept-ranges\";s:5:\"bytes\";}s:5:\"build\";s:14:\"20151005174638\";}','no'),(1586,'_tran